(2, 1, 'Terms & Conditions', '<h2>Yo!Rent (FATbit Technologies)</h2>\r\n<h6 class=\"descrptn_title\" style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 0px; font-family: Muli, sans-serif; line-height: 1.3; font-size: calc(14px + ((6 * (100vw - 320px)) / 1600)); color: rgb(34, 34, 34); letter-spacing: 0.32px; background-color: rgb(255, 255, 255);\">(Terms 1<span style=\"box-sizing: inherit; margin: 0px; padding: 0px; color: rgb(255, 57, 87); display: inline-block; vertical-align: top;\">st</span>&nbsp;to 25<span style=\"box-sizing: inherit; margin: 0px; padding: 0px; color: rgb(255, 57, 87); display: inline-block; vertical-align: top;\">th</span>&nbsp;Standard Terms applicable on all services/projects)</h6>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">1. Contract:</span>&nbsp;The clientâ€™s approval for work to commence shall be deemed a contractual agreement between the Client and Yo!Rent. The approval for the work can be through either an email confirming back the quote (with the quote document attached) or the quote document signed by the client.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">Whereas, Yo!Rent is in the business of providing Consultancy and allied Services on Computer based Information Technology, to its clientele, including any affiliates, subsidiaries, divisions of Yo!Rent\'s clients and customers (hereinafter referred to as \"Customers\") and Yo!Rent is in the business of producing Softwares, Designs, Software Planning Documents/Diagrams and Creative works for its Customers â€“ whether copyrightable/patentable or not (hereinafter referred to as \"Productâ€ or \"Productsâ€)</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">Now THEREFORE, in consideration of mutual promises, covenants and conditions set forth herein, The parties hereto agree to the terms mentioned in this agreement/proposal.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"font-weight: bold;\">Important:</span>&nbsp;Payment of the advance fee indicates that the client accepts these terms and conditions, and approves to commence the work.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">2. Usage of Yo!Rent Services/Products/Solutions:</span>&nbsp;Client agrees not to use the Yo!Rent services/products delivered for any business which is harmful to the society or children or is illegal. Further the Client is fully responsible for all and any content published/distributed or allowed to be published/distributed through the Clientâ€™s website whether hosted on servers owned/maintained by Yo!Rent or by the Client himself. Client shall execute best possible precautionary and security measures to restrict any illegitimate use of the services/solutions precured from Yo!Rent.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">3. 1 Year Free Technical Support:</span>&nbsp;Yo!Rent provides 1 year free technical support for following kind of issues:</p>\r\n<ul class=\"lower-alpha\" style=\"box-sizing: inherit; margin: 0px 0px 0px 30px; padding: 0px 0px 5px; list-style: none; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Server side scripting/programming errors/bugs</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Logical Bugs/Calculation related errors/bugs</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Connection errors/API Integration Errors</li>\r\n</ul>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">Above support is not available if the errors/bugs arise due to any external entity. Examples:</p>\r\n<ul class=\"lower-alpha\" style=\"box-sizing: inherit; margin: 0px 0px 0px 30px; padding: 0px 0px 5px; list-style: none; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Server or software or application or extension downgrades or upgrades</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Edits done in the code/scripts delivered by any external entity/person/professional</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Operating System or Browser Version Downgrades/Upgrades</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Any other factor which is not directly related to any deficiency at the end of Yo!Rent</li>\r\n</ul>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">Above support is not available for following kind of instances, unless otherwise specifically covered in the scope of project and/or deliverables:</p>\r\n<ul class=\"lower-alpha\" style=\"box-sizing: inherit; margin: 0px 0px 0px 30px; padding: 0px 0px 5px; list-style: none; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Training for using the software/solutions delivered</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">General enquiries/questions related to particular features of the software/solution delivered</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Cosmetic updates and/or UI/UX updates</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Enhancements or modifications in the default features/functional logics of the software/solutions delivered</li>\r\n</ul>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">4. Photography and graphics:</span>&nbsp;Both the parties agree to abide by the following terms:</p>\r\n<ul class=\"lower-alpha\" style=\"box-sizing: inherit; margin: 0px 0px 0px 30px; padding: 0px 0px 5px; list-style: none; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Unless otherwise agreed - Stock Images used for creating any banner or promotion graphic or animation are not part of the project deliverables, Client should purchase the license to use the stock images from respective 3rd parties at his/her own cost.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Yo!Rent may use stock photographs and images while creating the website. Images and graphics purchased from stock libraries are not generally included in the quote and will be invoiced separately.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">At request of the Client - Yo!Rent will keep the client updated about the stock images being used and the cost involved before raising the invoice.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Images used by Yo!Rent for product demos shall not be used by the client unless the client has purchased the usage rights for those images. Client shall be fully responsible for violation of any 3rd party copyright.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">Images delivered by Yo!Rent along with a bundled software/solution/script are for Demo Purpose only and shall not be used for commercial purpose. Client should contact Yo!Rent for more information about the price of those images if the Client wishes to use those images for commercial purpose OR Client should replace the default images with the images owned by the Client.</li>\r\n</ul>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 