lays from client side in providing the required feedback/information/data to finish the project shall exempt Yo!Rent from meeting the timelines mentioned in the quote.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">In case client does not provide required details/data/information for more than 15 working days, client authorizes Yo!Rent to forfeit the payments made towards this project.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">In case, during the project duration, the client does not maintain communication with Yo!Rent for more than 30 calendar days, client agrees that the project/services shall be deemed as received and accepted by the client, and the client further authorizes Yo!Rent to mark the project completed and invoice the client for remaining un-invoiced amount as per the total project price agreed.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">However, Client can instruct Yo!Rent to put project on hold provided:</p>\r\n<ul class=\"lower-alpha\" style=\"box-sizing: inherit; margin: 0px 0px 0px 30px; padding: 0px 0px 5px; list-style: none; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">client agrees to pay project resumption fee of USD 1,000 or 25% of the total project price, whichever is higher.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">â€˜on-holdâ€™ period does not exceed 2 calendar months</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">client agrees the professionals attached to the project (Project Team Structure) may be different from originally agreed.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\">client agrees to pay this project resumption fee every time a project is being put â€˜on-holdâ€™</li>\r\n</ul>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">20. Escalation:</span>&nbsp;Yo!Rent ensures you get right assistance to resolve issues in a timely manner. If your concerns are not entertained to your satisfaction, you can escalate critical issues to higher level of management. You may follow the below-mentioned escalation matrix to avoid any delay or discomfort in the event of dissatisfaction.</p>\r\n<ul class=\"lower-alpha\" style=\"box-sizing: inherit; margin: 0px 0px 0px 30px; padding: 0px 0px 5px; list-style: none; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">First Level Escalation:</span>&nbsp;In case of delay in project timelines or unsatisfactory response from your associated Project Manager/Business Analyst, You may escalate your case to&nbsp;<a href=\"mailto:salesteam@fatbit.com\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-decoration-line: none; line-height: inherit; outline: none; transition: all 0.5s ease-in-out 0s;\">Kapil Grover</a>,&nbsp;<a href=\"mailto:shekhar.sharda@fatbit.com\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-decoration-line: none; line-height: inherit; outline: none; transition: all 0.5s ease-in-out 0s;\">Shekhar Sharda&nbsp;</a>or&nbsp;<a href=\"mailto:rohit.kapoor@fatbit.com\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-decoration-line: none; line-height: inherit; outline: none; transition: all 0.5s ease-in-out 0s;\">Rohit Kapoor</a>&nbsp;and expect a response within next 2 working days.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 10px 15px; list-style: lower-alpha inside; position: relative; color: rgb(74, 73, 73); font-size: 15px;\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">Final Escalation:</span>&nbsp;If you donâ€™t receive a satisfactory solution from any of the team members following the first level of escalation, or haven\'t received a reply within 5 business days after submitting your Feedback/Query/Complaint, you may escalate your case to our Chief Sales Officer&nbsp;<a href=\"mailto:sales@fatbit.com\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-decoration-line: none; line-height: inherit; outline: none; transition: all 0.5s ease-in-out 0s;\">Mr. Rajiv Sharma</a>. Rest assured that immediate action will be taken.</li>\r\n</ul>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">21. Time Estimates:</span>&nbsp;Client agrees that stipulated timelines cannot be met if the project scope is changed by client once the project scope document is finalized. Client agrees not to change the requirements without extending the original agreed timelines by minimum 1 week against each change request.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">22. Share in profits from business or sale of business:&nbsp;</span>After client makes the agreed payment for the project, Yo!Rent will not claim share in clientâ€™s profits from business or from sale of business to some other company.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">23. Copyright/Ownership Rights:</span>&nbsp;Yo!Rent will retain the copyright of any material, including design, artwork and the source code, created for the client by Yo!Rent. Yo!Rent reserves the right to retain the copyright on all material created by Yo!Rent unless otherwise agreed between the two parties in writing. As per the agreed terms client owns rights on following items:</p>\r\n<ul class=\"terms_listing\" style=\"box-sizing: inherit; margin: 0px 0px 0px 30px; padding: 0px 0px 5px; list-style: none; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">Logo/Graphics/Pictures/Images supplied by client â€“ Yes</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">Website Interface/PSD/Creatives/Designs â€“ Yes, if client has ordered custom design with Exclusive Rights.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">Programming Files/Source Code â€“ Yes, if the Client has ordered the project with Exclusive Rights. Client does not own the copyright/Intellectual property rights for projects being done on Single Domain License basis.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">If the project is being done on Single Domain License basis, Client owns the rights to use the system only on designated domains and Client should take reasonable care of the system files to restrict un-authorized access of the system scripts/source code delivered.</li>\r\n</ul>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">24. Ownership of Code and Intellectual Property Rights:</span>&nbsp;Unless otherwise agreed, Yo!Rent is the owner of the source code and the intellectual property rights and reserves the right to reuse the code for other projects. Following terms shall be applicable and obliged:</p>\r\n<ul class=\"terms_listing\" style=\"box-sizing: inherit; margin: 0px 0px 0px 30px; padding: 0px 0px 5px; list-style: none; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">Client shall not create un-authorized copies of any Software/Scripts/Designs/File/Document/Information delivered to the Client by Yo!Rent</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">Client shall not access and/or share and/or transfer any Software/Products/information/document owned by Yo!Rent unless authorized to do so</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">Client shall not reverse engineer any software/script/application owned by Yo!Rent.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">Client shall not make any Software/Document/File/Information available to any third party in any manner, nor may Client use such works to provide services to any third party unless explicitly agreed otherwise in writing.</li>\r\n	<li style=\"box-sizing: inherit; margin: 0px; padding: 0px 0px 5px; position: relative; color: rgb(74, 73, 73); font-size: 15px; list-style: lower-roman;\">In the event that Client breaches any of terms specified in this clause, Client hereby authorizes any court of competent jurisdiction in India or Abroad to pass the judgment against the Client for and in the amount of USD 100,000 (USD Dollar One Hundred Thousand) for each default, as provided in the afore mentioned paragraphs, together with costs of suit and the cost of attorney incurred by Yo!Rent for recovery of above compensation/damages from Client. These damages/compensation allowed shall be considered as interim relief to Yo!Rent and Yo!Rent shall have the liberty to claim higher amount as compensation for the direct/indirect damages and Employer may pursue criminal proceedings as well</li>\r\n</ul>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">25. Termination of the agreement:</span>&nbsp;If either party terminates this Agreement for any reason, the parties will continue to perform all of their respective obligations under this Agreement</p>\r\n<h3 class=\"descrptn_title\" style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 0px; font-family: Muli, sans-serif; line-height: 1.3; font-size: calc(17px + ((15 * (100vw - 320px)) / 1600)); font-weight: 400; color: rgb(34, 34, 34); letter-spacing: 0.32px; background-color: rgb(255, 255, 255);\">(Terms 26th to 29th are only applicable in case of Single Domain Non Exclusive License)</h3>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">26. Single Domain License:&nbsp;</span>Unless otherwise agreed, client agrees to setup the scripts delivered only on one domain, one sub-domain (wip.yourdomain.com) and localhost. However if client wish to run same website on different domain/sub-domain, then client has to purchase separate license for each domain/sub-domain.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">No license would be required for Add-on Domains that will point to the main domain where this system will be implemented. All add-on domains will be forwarded to the main domain from the hosting server and no additional license would be required for these domains.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">For every new domain or sub-domain , client has to buy a separate license.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">27. License Validity Period:</span>&nbsp;Limited period license is issued initially. After 6 months from the date of full payment, life time license is issued. Feel Free to contact Yo!Rent Support Team, in case your license has expired and payment has been made in full, such issues will be resolved on highest priority.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">28. No recurring costs of license:</span>&nbsp;There is no renewal/recurring license fee. However, if client wishes to run same website on different domain or sub domain, then client has to purchase separate license for each domain or sub domain.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">29. Use of encrypted files:</span>&nbsp;Unless otherwise agreed, Yo!Rent can use own framework (code library in encrypted format) for web applications development for making source code of our intellectual property/scripts secure from other programmers; faster turnaround time; and bug free application development. Client will be provided with detailed documentation for using framework (code library functions). With the help of documentation provided, other programmers can modify the website functionality. Yo!Rent framework is collection of functions related to Database Manipulation, Images/Files Management, Paging, and Form Builder etc. which looks like PHP Functions but have different syntax than default PHP functions. Other willing and efficient PHP programmers can learn and practice these functions/framework within 2-4 days.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-weight: 700;\">Note :</span>&nbsp;In no event, Yo!Rent shall be liable to the client or any third party for any damages, including any lost profits, lost savings or other incidental, consequential or special damages arising out of the operation of or inability to operate these Web pages or website, even if Yo!Rent has been advised of the possibility of such damages. Despite the best efforts of Yo!Rent, errors in web page information may occur. At no time will Yo!Rent be held responsible for accidentally including erroneous information, extending beyond correcting the error.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">Should Yo!Rent waive any of these terms on an individual basis, this shall not affect the validity of remaining clauses or commit Yo!Rent to waive the same clause on any other occasion.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">By agreeing to these terms and conditions, your statutory rights are not affected.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px; padding: 8px 0px; font-size: 15px; color: rgb(34, 34, 34); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0.32px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">Yo!Rent reserves the right to change or modify any of these terms or conditions at any time, but agreements signed prior to the updates in this agreement remains unaffected. Please feel free to contact us for more info/clarification about any of the terms and conditions mentioned above.</p>', '', '');
