(2, 2, 'البنود و الظروف', '<div>يو يو كارت (FATbit Technologies)</div>\r\n<div>(الشروط من 1 إلى 25 من الشروط القياسية المطبقة على جميع الخدمات / المشاريع)</div>\r\n<div>1. العقد: تعتبر موافقة العميل على بدء العمل بمثابة اتفاقية تعاقدية بين العميل ويو كارت. يمكن أن تتم الموافقة على العمل إما من خلال رسالة بريد إلكتروني تؤكد إعادة عرض السعر (مع إرفاق مستند عرض الأسعار) أو مستند عرض الأسعار الذي وقعه العميل.</div>\r\n<div><br />\r\n	</div>\r\n<div>وحيث أن Yo! Kart تعمل في مجال تقديم الخدمات الاستشارية والتحالفة على تكنولوجيا المعلومات المعتمدة على الكمبيوتر ، لعملائها ، بما في ذلك أي من الشركات التابعة والشركات التابعة وأقسام عملاء Yo! Kart والعملاء (المشار إليها فيما يلي باسم \"العملاء\") ويو ! Kart تعمل في مجال إنتاج البرامج / التصميمات ووثائق / مخططات تخطيط البرامج والأعمال الإبداعية لعملائها - سواء كانت محمية بحقوق الطبع والنشر / غير مؤهلة للبراءة أم لا (يشار إليها فيما يلي باسم \"المنتج\" أو \"المنتجات\")</div>\r\n<div><br />\r\n	</div>\r\n<div>الآن ، نظرًا للوعود المتبادلة والعهود والشروط المنصوص عليها في هذه الوثيقة ، يوافق الطرفان على الشروط المذكورة في هذه الاتفاقية / الاقتراح.</div>\r\n<div><br />\r\n	</div>\r\n<div>هام: يشير دفع الرسوم المقدمة إلى أن العميل يقبل هذه الشروط والأحكام ، ويوافق على بدء العمل.</div>\r\n<div><br />\r\n	</div>\r\n<div>2. استخدام خدمات / منتجات / حلول Yo! Kart: يوافق العميل على عدم استخدام خدمات / منتجات Yo! Kart المقدمة لأي عمل ضار بالمجتمع أو الأطفال أو غير قانوني. علاوة على ذلك ، يتحمل العميل المسئولية الكاملة عن أي محتوى يتم نشره / توزيعه أو السماح بنشره / توزيعه من خلال موقع الويب الخاص بالعميل سواء استضافته على خوادم تملكها / تحتفظ بها Yo! Kart أو بواسطة العميل نفسه. يجب على العميل تنفيذ أفضل التدابير الوقائية والأمنية الممكنة لتقييد أي استخدام غير قانوني للخدمات / الحلول التي تم الحصول عليها من Yo! Kart.</div>\r\n<div><br />\r\n	</div>\r\n<div>3. دعم فني مجاني لمدة عام واحد: تقدم Yo! Kart دعمًا فنيًا مجانيًا لمدة عام واحد من أجل المشكلات التالية:</div>\r\n<div><br />\r\n	</div>\r\n<div>خادم الجانب البرمجة / أخطاء البرمجة / الأخطاء</div>\r\n<div>الأخطاء المنطقية / حساب الأخطاء / الأخطاء</div>\r\n<div>أخطاء الاتصال / أخطاء تكامل API</div>\r\n<div>لا يتوفر الدعم أعلاه إذا ظهرت أخطاء / أخطاء بسبب أي كيان خارجي. أمثلة:</div>\r\n<div><br />\r\n	</div>\r\n<div>خادم أو برنامج أو تطبيق أو تمديد خفض أو ترقيات</div>\r\n<div>التعديلات التي تم إجراؤها في الكود / النصوص التي يتم تسليمها بواسطة أي كيان خارجي / شخص / محترف</div>\r\n<div>نظام التشغيل أو إصدار المتصفح تخفيضات / ترقيات</div>\r\n<div>أي عامل آخر لا يرتبط مباشرة بأي نقص في نهاية يو كارت</div>\r\n<div>لا يتوفر الدعم أعلاه للنوع التالي من الحالات ، ما لم تتم تغطيته على وجه التحديد في نطاق المشروع و / أو النواتج:</div>\r\n<div><br />\r\n	</div>\r\n<div>التدريب على استخدام البرامج / الحلول المقدمة</div>\r\n<div>استفسارات عامة / أسئلة متعلقة بميزات معينة من البرنامج / الحل المقدم</div>\r\n<div>تحديثات مستحضرات التجميل و / أو تحديثات UI / UX</div>\r\n<div>تحسينات أو تعديلات في الميزات الافتراضية / المنطق الوظيفي للبرنامج / الحلول المقدمة</div>\r\n<div>4. التصوير الفوتوغرافي والرسومات: يتفق الطرفان على الالتزام بالشروط التالية:</div>\r\n<div><br />\r\n	</div>\r\n<div>ما لم يتم الاتفاق على خلاف ذلك - لا تعتبر الصور المخزنة المستخدمة لإنشاء أي شعار أو رسم ترويجي أو رسوم متحركة جزءًا من نتائج المشروع ، يجب على العميل شراء الترخيص لاستخدام الصور المخزنة من الأطراف الثالثة المعنية على نفقته الخاصة.</div>\r\n<div>قد تستخدم Yo! Kart الصور الفوتوغرافية والصور أثناء إنشاء موقع الويب. لا يتم تضمين الصور والرسومات التي تم شراؤها من مكتبات الأسهم بشكل عام في الاقتباس وسيتم إصدار فواتير بشكل منفصل.</div>\r\n<div>بناءً على طلب العميل - ستقوم Yo! Kart بإطلاع العميل على آخر المستجدات حول صور المخزون المستخدمة والتكلفة المترتبة عليها قبل رفع الفاتورة.</div>\r\n<div>لا يجوز للعميل استخدام الصور التي يستخدمها Yo! Kart للعروض التوضيحية للمنتج إلا إذا اشترى العميل حقوق الاستخدام لتلك الصور. يتحمل العميل المسؤولية الكاملة عن انتهاك حقوق الطبع والنشر لأي طرف ثالث.</div>\r\n<div>الصور التي قدمتها Yo! Kart مع برنامج / حل / نص برمجي مخصص لأغراض العرض التوضيحي فقط ولا يجوز استخدامها لأغراض تجارية. يجب على العميل الاتصال Yo! Kart للحصول على مزيد من المعلومات حول سعر هذه الصور إذا كان العميل يرغب في استخدام هذه الصور لأغراض تجارية أو يجب على العميل استبدال الصور الافتراضية بالصور التي يملكها العميل.</div>\r\n<div>5. توافق المتصفح: يبذل Yo! Kart قصارى جهده لتصميم الصفحات التي لا تشوبها شائبة في معظم المتصفحات الحالية الشائعة ، أي أحدث إصدار من IE / FireFox / Chrome تم إصداره في تاريخ اتفاقية المشروع. ومع ذلك ، لا يمكن اعتبار Yo! Kart مسؤولة عن الصفحات التي لا يتم عرضها بشكل مقبول في الإصدارات الأحدث من المستعرضات التي تم إصدارها بعد تصميم الصفحات. تعد إصدارات IE11 والإصدارات الأقدم من IE متصفحات قديمة ، وبالتالي لا نقوم بتصميمها مع أخذها في الاعتبار. نوصي باستخدام أحدث إصدار من Chrome أو Firefox بدلاً من الإصدارات القديمة من Microsoft Internet Explorer. بإمكان Yo! Kart العمل على تحسين واجهة المستخدم / UX للإصدارات القديمة من Internet Explorer مقابل تكلفة إضافية.</div>\r\n<div><br />\r\n	</div>\r\n<div>6. تقديم محرك البحث: الخدمات التالية ليست جزءًا من المشروع ما لم يتم الاتفاق على خلاف ذلك كتابيًا:</div>\r\n<div><br />\r\n	</div>\r\n<div>تقديم المواقع على محركات البحث المختلفة.</div>\r\n<div>تأمين مرتبة جيدة</div>', '', ''),
(3, 1, 'Privacy Policy', '<div class=\"content-area privacy section_space\">\r\n	<h5>What information do we collect?</h5>\r\n	<p>We collect information from you when you fill out a form. When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address, phone number or credit card information. You may, however, visit our site anonymously.</p>\r\n	<h5>What do we use your information for? </h5>\r\n	<p>Any of the information we collect from you may be used in one of the following ways:</p>\r\n	<ul class=\"lisint_points\">\r\n		<li>To personalize your experience\r\n			<ul>\r\n				<li>Your information helps us to better respond to your individual needs</li>\r\n			</ul></li>\r\n		<li>To improve our website\r\n			<ul>\r\n				<li>We continually strive to improve our website offerings based on the information and feedback we receive from you</li>\r\n			</ul></li>\r\n		<li>To improve customer service\r\n			<ul>\r\n				<li>Your information helps us to more effectively respond to your customer service requests and support needs</li>\r\n			</ul></li>\r\n		<li>To process transactions\r\n			<ul>\r\n				<li>Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested. </li>\r\n			</ul></li>\r\n		<li>To administer a contest, promotion, survey or other site feature</li>\r\n		<li>To send periodic emails\r\n			<ul>\r\n				<li>The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.</li>\r\n			</ul></li> \r\n	</ul> \r\n	<h5>How do we protect your information?</h5>\r\n	<p>We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information. </p>\r\n	<h5>Do we use cookies? </h5>\r\n	<p>Yes (Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information We use cookies to understand and save your preferences for future visits and compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future. We may contract with third-party service providers to assist us in better understanding our site visitors. These service providers are not permitted to use the information collected on our behalf except to help us conduct and improve our business.</p>\r\n	<h5>Do we disclose any information to outside parties? </h5>\r\n	<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.</p>\r\n	<h5>Third party links </h5>\r\n	<p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.</p>\r\n	<h5> California Online Privacy Protection Act Compliance</h5>\r\n	<p>Because we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We therefore will not distribute your personal information to outside parties without your consent.</p>\r\n	<h5>Childrens Online Privacy Protection Act Compliance </h5>\r\n	<p> We are in compliance with the requirements of COPPA (Childrens Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.</p>\r\n	<h5> Online Privacy Policy Only </h5>\r\n	<p>This online privacy policy applies only to information collected through our website and not to information collected offline.</p>\r\n	<h5>Terms and Conditions </h5>\r\n	<p> Please also visit our Terms and Conditions section establishing the use, disclaimers, and limitations of liability governing the use of our website at <a class=\"text--lnk\" href=\"http://Yo-Rent.com\">http://Yo-Rent.com</a>.</p>\r\n	<h5>Your Consent </h5>\r\n	<p> By using our site, you consent to our online privacy policy. </p>\r\n	<h5> Changes to our Privacy Policy </h5>\r\n	<p>If we decide to change our privacy policy, we will post those changes on this page. </p>\r\n	<h5>Contacting Us </h5>\r\n	<p>If there are any questions regarding this privacy policy you may <a class=\"text--lnk\" href=\"https://www.Yo-Rent.com/contact-us.html\">contact us</a>.</p></div>', '', ''),
(3, 2, 'سياسة خاصة', '<div>ما هي المعلومات التي نقوم بجمعها؟</div>\r\n<div>نقوم بجمع معلومات منك عند ملء نموذج. عند الطلب أو التسجيل على موقعنا ، حسب الاقتضاء ، قد يُطلب منك إدخال: الاسم أو عنوان البريد الإلكتروني أو العنوان البريدي أو رقم الهاتف أو معلومات بطاقة الائتمان. يمكنك، ومع ذلك، يرجى زيارة موقعنا مجهول.</div>\r\n<div><br />\r\n	</div>\r\n<div>ماذا نستخدم المعلومات الخاصة بك؟</div>\r\n<div>يمكن استخدام أي من المعلومات التي نجمعها منك بأحد الطرق التالية:</div>\r\n<div><br />\r\n	</div>\r\n<div>لتخصيص تجربتك</div>\r\n<div>تساعدنا معلوماتك على الاستجابة بشكل أفضل لاحتياجاتك الفردية</div>\r\n<div>لتحسين موقعنا</div>\r\n<div>نسعى باستمرار لتحسين عروض موقعنا على أساس المعلومات والتعليقات التي نتلقاها منك</div>\r\n<div>لتحسين خدمة العملاء</div>\r\n<div>تساعدنا معلوماتك على الاستجابة بشكل أكثر فعالية لطلبات خدمة العملاء واحتياجات الدعم</div>\r\n<div>لمعالجة المعاملات</div>\r\n<div>معلوماتك ، سواء كانت عامة أو خاصة ، لن يتم بيعها أو تبادلها أو نقلها أو تسليمها إلى أي شركة أخرى لأي سبب من الأسباب ، دون موافقتك ، بخلاف الغرض الصريح المتمثل في تسليم المنتج أو الخدمة المشتراة المطلوبة.</div>\r\n<div>لإدارة المسابقة أو الترويج أو الاستطلاع أو ميزة موقع أخرى</div>\r\n<div>لإرسال رسائل البريد الإلكتروني الدورية</div>\r\n<div>يمكن استخدام عنوان البريد الإلكتروني الذي تقدمه لمعالجة الطلبات ، لإرسال المعلومات والتحديثات المتعلقة بطلبك ، بالإضافة إلى تلقي أخبار الشركة أو التحديثات أو معلومات المنتج أو الخدمة ذات الصلة ، إلخ.</div>\r\n<div>كيف نحمي معلوماتك؟</div>\r\n<div>ننفذ مجموعة متنوعة من التدابير الأمنية للحفاظ على سلامة معلوماتك الشخصية عند تقديم طلب أو إدخال معلوماتك الشخصية أو إرسالها أو الوصول إليها.</div>\r\n<div><br />\r\n	</div>\r\n<div>هل نستخدم ملفات تعريف الارتباط؟</div>\r\n<div>نعم (ملفات تعريف الارتباط هي ملفات صغيرة ينقلها أحد المواقع أو مزود الخدمة الخاص به إلى محرك الأقراص الثابتة لأجهزة الكمبيوتر لديك من خلال متصفح الويب الخاص بك (إذا سمحت بذلك) التي تمكن المواقع أو أنظمة موفري الخدمة من التعرف على المستعرض الخاص بك والتقاط وتذكر بعض المعلومات التي نستخدمها فهم وحفظ التفضيلات الخاصة بك للزيارات المستقبلية وتجميع البيانات المجمعة حول حركة المرور في الموقع والتفاعل مع الموقع حتى نتمكن من تقديم تجارب وأدوات أفضل في الموقع في المستقبل. لا يُسمح لمقدمي الخدمات هؤلاء باستخدام المعلومات التي يتم جمعها نيابة عنا إلا لمساعدتنا على إدارة أعمالنا وتحسينها.</div>\r\n<div><br />\r\n	</div>\r\n<div>هل نفصح عن أي معلومات للأطراف الخارجية؟</div>\r\n<div>نحن لا نبيع أو نتاجر أو ننقل معلوماتك الشخصية إلى أطراف خارجية. لا يشمل ذلك الأطراف الثالثة الموثوقة التي تساعدنا في تشغيل موقعنا ، أو إدارة أعمالنا ، أو تقديم الخدمات لك ، طالما وافقت تلك الأطراف على الحفاظ على سرية هذه المعلومات. قد نصدر أيضًا معلوماتك عندما نعتقد أن الإصدار مناسب للامتثال للقانون ، أو تطبيق سياسات موقعنا ، أو حماية حقوقنا أو حقوقنا أو ممتلكاتنا أو سلامتنا. ومع ذلك ، قد يتم تقديم معلومات الزائر غير المحددة للهوية إلى أطراف أخرى للتسويق أو الإعلان أو استخدامات أخرى.</div>\r\n<div><br />\r\n	</div>\r\n<div>روابط الطرف الثالث</div>\r\n<div>في بعض الأحيان ، وفقًا لتقديرنا ، قد نقوم بتضمين أو تقديم منتجات أو خدمات جهة خارجية على موقعنا. مواقع الطرف الثالث هذه لديها سياسات خصوصية منفصلة ومستقلة. لذلك لا نتحمل أي مسؤولية أو مسؤولية عن محتوى وأنشطة هذه المواقع المرتبطة. ومع ذلك ، فإننا نسعى إلى حماية سلامة موقعنا ونرحب بأي ملاحظات حول هذه المواقع.</div>\r\n<div><br />\r\n	</div>\r\n<div>كاليفورنيا قانون حماية الخصوصية على الإنترنت الامتثال</div>\r\n<div>نظرًا لأننا نقدر خصوصيتك ، فقد اتخذنا الاحتياطات اللازمة للتوافق مع قانون حماية الخصوصية على الإنترنت في كاليفورنيا. لذلك لن نقوم بتوزيع معلوماتك الشخصية على أطراف خارجية دون موافقتك.</div>\r\n<div><br />\r\n	</div>\r\n<div>قانون حماية خصوصية الأطفال عبر الإنترنت</div>\r\n<div>نحن نلتزم بمتطلبات COPPA (قانون حماية خصوصية الأطفال على الإنترنت) ، نحن لا نجمع أي معلومات من أي شخص يقل عمره عن 13 عامًا. يتم توجيه كل من موقعنا ومنتجاتنا وخدماتنا إلى أشخاص لا يقل عمرهم عن 13 عامًا أو أكبر.</div>\r\n<div><br />\r\n	</div>\r\n<div>سياسة الخصوصية عبر الإنترنت فقط</div>\r\n<div>تنطبق سياسة الخصوصية عبر الإنترنت هذه فقط على المعلومات التي يتم جمعها من خلال موقعنا الإلكتروني وليس على المعلومات التي يتم جمعها في وضع عدم الاتصال.</div>\r\n<div><br />\r\n	</div>\r\n<div>الأحكام والشروط</div>\r\n<div>يرجى أيضًا زيارة قسم البنود والشروط الذي يحدد استخدام وإخلاء المسئولية وحدود المسؤولية التي تحكم استخدام موقعنا على http://Yo-Rent.com.</div>\r\n<div><br />\r\n	</div>\r\n<div>موافقتك</div>\r\n<div>باستخدام موقعنا ، فإنك توافق على سياسة الخصوصية على الإنترنت.</div>\r\n<div><br />\r\n	</div>\r\n<div>التغييرات في سياسة الخصوصية الخاصة بنا</div>\r\n<div>إذا قررنا تغيير سياسة الخصوصية الخاصة بنا ، فسنقوم بنشر هذه التغييرات على هذه الصفحة.</div>', '', '');
