INSERT INTO `tbl_email_templates` (`etpl_code`, `etpl_lang_id`, `etpl_name`, `etpl_subject`, `etpl_body`, `etpl_replacements`, `etpl_status`) VALUES
('abandoned_cart_deleted_discount_notification', 1, 'Abandoned Cart Deleted Discount Notification', 'Abandoned Cart Deleted Discount Notification', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Abandoned Cart Deleted</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong></h4>                \r\n				<p>We noticed you removed <span style=\"text-decoration: underline;\">{product_name}</span> from your cart.</p>                \r\n				<p>Just for you : Get <strong>{discount}</strong> off on your order with code <span style=\"color:#333; font-weight: bold;\">{coupon_code}.</span> <a href=\"{checkout_now}\" style=\"background: #ff3a59;border:none; border-radius: 4px; color: #fff; cursor: pointer;margin:10px 0 0 0;width: auto; font-weight: normal; padding: 10px 20px; display: inline-block; \">Check out now </a></p></td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} Name of the email receiver<br>\r\n{website_name} Name of our website<br>\r\n{website_url} URL of our website<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>\r\n{discount} <br>\r\n{coupon_code} <br>\r\n{checkout_now} <br>', 1),
('abandoned_cart_deleted_discount_notification', 2, 'إشعار الخصم المحذوف لسلة التسوق المهجورة', 'إشعار الخصم المحذوف لسلة التسوق المهجورة', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تم حذف العربة المهجورة</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong></h4>                \r\n				<p>لاحظنا أنك أزلت <span style=\"text-decoration: underline;\">{product_name}</span> من عربتك</p>                \r\n				<p>فقط بالنسبة لك : الحصول على <strong>{discount}</strong> قبالة على طلبك مع <span style=\"color:#333; font-weight: bold;\">رمز{coupon_code}.</span> <a href=\"{checkout_now}\" style=\"background: #ff3a59;border:none; border-radius: 4px; color: #fff; cursor: pointer;margin:10px 0 0 0;width: auto; font-weight: normal; padding: 10px 20px; display: inline-block; \"></a></p></td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} اسم جهاز استقبال البريد الإلكتروني<br>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL لموقعنا الإلكتروني<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>\r\n{discount}<br>\r\n{coupon_code}<br>\r\n{checkout_now}<br>', 1),
('abandoned_cart_discount_notification', 1, 'Abandoned Cart Discount Notification', 'Abandoned Cart Discount Notification', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Abandoned Cart Discount</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong></h4>                \r\n				<p>Finish your order before your items sell out</p>                \r\n				<p>Just for you : Get <strong>{discount}</strong> OFF on your order with code <span style=\"color:#333; font-weight: bold;\">{coupon_code}.</span> <a href=\"{checkout_now}\" style=\"background: #ff3a59;border:none; border-radius: 4px; color: #fff; cursor: pointer;margin:10px 0 0 0;width: auto; font-weight: normal; padding: 10px 20px; display: inline-block; \">Check out now </a></p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>            \r\n				<table>                \r\n					<tbody>                    \r\n						<tr>                        \r\n							<td style=\"padding-right: 25px; width: 50%;\"><img style=\"border: solid 1px #ececec; padding: 10px; border-radius: 4px;\" src=\"{product_image}\" /></td>                        \r\n							<td style=\"text-align: left; width: 50%;\"> <span style=\"font-size: 20px; font-weight:normal; color:#999999; \">{product_name}</span> <span style=\"font-size: 14px; font-weight: bold; color:#000000; display: block; padding: 20px 0;\">{product_price}</span> </td>                    \r\n						</tr>                \r\n					</tbody>            \r\n				</table>     \r\n            </td>        \r\n		</tr>        \r\n    \r\n	</tbody>\r\n</table>', '{user_full_name} Name of the email receiver<br>\r\n{website_name} Name of our website<br>\r\n{website_url} URL of our website<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>\r\n{discount} <br>\r\n{coupon_code} <br>\r\n{checkout_now} <br>\r\n{product_image} <br>\r\n{product_name} <br>\r\n{product_price}<br>', 1),
('abandoned_cart_discount_notification', 2, 'إشعار خصم العربة المهجور', 'إشعار خصم العربة المهجور', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">خصم العربة المهجورة</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong></h4>                \r\n				<p>إنهاء طلبك قبل بيع العناصر الخاصة بك</p>                \r\n				<p>فقط بالنسبة لك : الحصول على <strong>{discount}</strong> إيقاف على طلبك مع <span style=\"color:#333; font-weight: bold;\">رمز{coupon_code}.</span> <a href=\"{checkout_now}\" style=\"background: #ff3a59;border:none; border-radius: 4px; color: #fff; cursor: pointer;margin:10px 0 0 0;width: auto; font-weight: normal; padding: 10px 20px; display: inline-block; \"></a></p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>            \r\n				<table>                \r\n					<tbody>                    \r\n						<tr>                        \r\n							<td style=\"padding-right: 25px; width: 50%;\"><img style=\"border: solid 1px #ececec; padding: 10px; border-radius: 4px;\" src=\"{product_image}\" /></td>                        \r\n							<td style=\"text-align: left; width: 50%;\"><span style=\"font-size: 20px; font-weight:normal; color:#999999; \">{product_name}</span> <span style=\"font-size: 14px; font-weight: bold; color:#000000; display: block; padding: 20px 0;\">{product_price}</span></td>                    \r\n						</tr>                \r\n					</tbody>            \r\n				</table>     \r\n            </td>        \r\n		</tr>        \r\n    \r\n	</tbody>\r\n</table>', '{user_full_name} اسم جهاز استقبال البريد الإلكتروني<br>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL لموقعنا الإلكتروني<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>\r\n{discount}<br>\r\n{coupon_code}<br>\r\n{checkout_now}<br>\r\n{product_image}<br>\r\n{product_name}<br>\r\n{product_price}<br>', 1),
('abandoned_cart_email', 1, 'Abandoned Cart Email', 'Abandoned Cart Email', '<table width=\"100%\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\n    <tr>\n        <td style=\"background:#ff3a59;\">\n            <!--\n            page title start here\n            -->\n               \n            <table width=\"600\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\n                <tbody>\n                    <tr>\n                        <td style=\"background:#fff;padding:20px 0 10px; text-align:center;\">\n                            <h4 style=\"font-weight:normal; text-transform:uppercase; color:#999;margin:0; padding:10px 0; font-size:18px;\"></h4>\n                            <h2 style=\"margin:0; font-size:34px; padding:0;\">Abandoned Cart</h2></td>\n                    </tr>\n                </tbody>\n            </table>\n            <!--\n            page title end here\n            -->\n               </td>\n    </tr>\n    <tr>\n        <td>\n            <!--\n            page body start here\n            -->\n               \n            <table width=\"600\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\n                <tbody>\n                    <tr>\n                        <td style=\"background:#fff;padding:0 30px; text-align:center; color:#999;vertical-align:top;\">\n                            <table width=\"100%\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\n                                <tbody>\n                                    <tr>\n                                        <td style=\"padding:20px 0 30px;\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong></td>\n                                    </tr>\n                                    <tr>\n                                        <td style=\"padding:0 10px; line-height:1.3; text-align:center; color:#333333;vertical-align:top; font-size: 30px;\">We noticed you left something behind!</td>\n                                    </tr>\n                                    <tr>\n                                        <td style=\"padding:30px 0;\">\n                                        <table>{product_detail_table}</table>\n                                        </td>\n                                    </tr>\n                                    \n                                </tbody>\n                            </table></td>\n                    </tr>\n                </tbody>\n            </table>\n            <!--\n            page body end here\n            -->\n        </td>\n    </tr>\n</table>', '{user_full_name} Name of the email receiver<br>\r\n{website_name} Name of our website<br>\r\n{website_url} URL of our website<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>\r\n{product_detail_table} <br/>', 1),
