('ADMIN_ORDER_PAYMENT_TRANSFERRED_TO_BANK', 1, 'Order Payment Transferred To Bank', 'Order #{ORDER_ID} Payment Transferred To Bank', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Payment Transferred to Bank</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Admin </strong> <br />\r\n					 Order Payment Detail Submitted BY {USER_NAME} For #{ORDER_ID}.</h4>\r\n				<p>Please find the transfer information below.</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table width=\"100%\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:0 0 30px;\">Payment Method</td>\r\n							<td style=\"padding:0 0 30px;\">{PAYMENT_METHOD}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:0 0 30px;\">Transaction Id</td>\r\n							<td style=\"padding:0 0 30px;\">{TRANSACTION_ID}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:0 0 30px;\">Amount</td>\r\n							<td style=\"padding:0 0 30px;\">{AMOUNT}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:0 0 30px;\">Comments</td>\r\n							<td style=\"padding:0 0 30px;\">{COMMENTS}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{USER_NAME} - Name of the User.<br>\r\n{ORDER_ID} - Order Id.<br>\r\n{PAYMENT_METHOD} - Payment Method Used By Buyer.<br>\r\n{TRANSACTION_ID} - Transaction Id<br>\r\n{AMOUNT} - Amount<br>\r\n{COMMENTS} - Comments.<br>', 1),
