('affiliate_share_invitation_email', 1, 'Affiliate Invitation Email for Friends', 'Your friend has invited you for Amazing Discounts on {website_name}.', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">{website_name} Invitation!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Friend </strong>  This is an invitation from {user_full_name} to join them on <a href=\"{website_url}\">{website_name}</a> and enjoy Amazing Discounts.</h4>                \r\n				<p>Click the link below to accept this invitation:</p>                \r\n				<p><a href=\"{tracking_url}\" style=\"font-size:15px; color:#ff3a59;\">Click Here</a></p>                \r\n				<p>{invitation_message}</p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} Name of the email receiver.<br>\r\n{website_name} Name of our website<br>\r\n{website_url} URL/Link of our website<br>\r\n{tracking_url} referral url\r\n{invitation_message} <br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('affiliate_share_invitation_email', 2, 'البريد الإلكتروني دعوة تابعة للأصدقاء', 'وقد دعا صديقك لك للحصول على خصومات مذهلة على {website_name}.', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">{website_name} دعوة!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">صديقي العزيز</strong>  هذه دعوة من {user_full_name} للانضمام إليهم <a href=\"{website_url}\">في{website_name}</a> والاستمتاع بخصومات مذهلة.</h4>                \r\n				<p>انقر على الرابط أدناه لقبول هذه الدعوة:</p>                \r\n				<p><a href=\"{tracking_url}\" style=\"font-size:15px; color:#ff3a59;\">اضغط هنا</a></p>                \r\n				<p>{invitation_message}</p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} اسم جهاز استقبال البريد الإلكتروني.<br>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL/رابط موقعنا الإلكتروني<br>\r\nرابط الإحالة {tracking_url}\r\n{invitation_message}<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
