('buyer_notification_review_order_product', 2, 'المشتري مراجعة المنتج أمر - إعلام', 'مراجعة الطلب في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">طلب استطلاع ملاحظات</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />شكرا للتسوق ( طلب رقم الفاتورة {invoice_number}) مع <a href=\"{website_url}\">{website_name}</a>.</h4>                \r\n				<p>يرجى ردود الفعل تجربتك لهذا النظام <a href=\"{review_page_url}\">انقر هنا</a></p></td>\r\n		</tr>        \r\n		<tr>\r\n			<td>{order_items_table_format}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{user_full_name} اسم جهاز استقبال البريد الإلكتروني<br/> \r\n{new_order_status} حالة الطلب الجديد/الحالي<br/>\r\n{invoice_number} - رقم فاتورة أمر الطفل.<br/>\r\n{order_items_table_format} - عناصر ترتيب تابع بتنسيق جدولي.<br/>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL لموقعنا الإلكتروني<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>\r\n', 1),
('buyer_notification_review_status_updated', 1, 'Buyer Product Review Status Change - Notification', 'Product Review Status Changed at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">Review Status Changed</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong><br />\r\n					  Your Review status has been changed to {new_status} at <a href=\"{website_url}\">{website_name}</a>.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} Name of the email receiver<br/> \r\n{new_status} New/Current Review Status<br/>\r\n{website_name} Name of our website<br>\r\n{website_url} URL of our website<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>\r\n', 1),
('buyer_notification_review_status_updated', 2, 'تغيير حالة مراجعة المنتج للمشتري - إعلام', 'تغيير حالة مراجعة المنتج عند {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">تغيير حالة المراجعة</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />تم تغيير حالة المراجعة إلى {new_status} في <a href=\"{website_url}\">{website_name}</a>.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} اسم جهاز استقبال البريد الإلكتروني<br/> \r\n{new_status} حالة المراجعة الجديدة/الحالية<br/>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL لموقعنا الإلكتروني<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>\r\n', 1),
('cancellation_request_approved_declined', 1, 'Cancellation Request Approved/Declined Email for User', 'Order Cancellation Request {request_status} on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Order Cancellation Request Updated </h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_name} </strong> <br />\r\n					 Your order cancellation request on {invoice_number} has been {request_status} on <a href=\"{website_url}\">{website_name}</a>.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_name} Name of the email receiver<br />\r\n{invoice_number} Order Invoice Number<br />\r\n{request_status} New Withdrawal Request Status<br />\r\n{website_name} Name of the website<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('cancellation_request_approved_declined', 2, 'طلب الإلغاء الموافق عليه/ المرفوض للبريد الإلكتروني للمستخدم', 'طلب إلغاء الطلب {request_status} على {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تحديث طلب إلغاء الطلب </h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_name}</strong><br />تم {request_status} طلب إلغاء طلبك على {invoice_number} في <a href=\"{website_url}\">{website_name}. </a></h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_name} اسم جهاز استقبال البريد الإلكتروني<br />\r\nرقم فاتورة طلب {invoice_number}<br />\r\n{request_status} حالة طلب سحب جديدة<br />\r\n{website_name} اسم الموقع<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('cancel_subscription_email', 1, 'Cancel Subscription Email', 'Cancel Subscription Email', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">Cancel Subscription!</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong><br />\r\n					 your {spackage_name} plan has been canceled.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} Name of the email receiver<br>\r\n{website_name} Name of our website<br>\r\n{website_url} URL of our website<br>\r\n{reset_url} URL to reset the password<br>\r\n{spackage_name} Package name <br>\r\n', 1),
('cancel_subscription_email', 2, 'إلغاء البريد الإلكتروني للاشتراك', 'إلغاء البريد الإلكتروني للاشتراك', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">إلغاء الاشتراك!</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />تم إلغاء خطة {spackage_name} الخاصة بك.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} اسم جهاز استقبال البريد الإلكتروني<br>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL لموقعنا الإلكتروني<br>\r\n{reset_url} URL لإعادة تعيين كلمة المرور<br>\r\nاسم حزمة {spackage_name}<br>\r\n', 1),
('catalog_request_message_user', 1, 'Catalog request message notification', 'New message received on catalog request at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">Message Posted</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong><br />\r\n					  {username} has posted a message on catalog request at <a href=\"{website_url}\">{website_name}</a></h4>              \r\n				<p style=\"margin:0px;\">Message is given as below:</p>                \r\n				<p style=\"margin:0px;\">{message}</p>                \r\n				<p style=\"margin:0px;\">Please {click_here} to reply to this message.</p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} - Name of the email receiver<br/>\n{username} username of the person posted a message.<br />\n{request_number} Request number on which message is posted.<br />\n{message} message body/comments sent by the sender<br />\n{click_here} Link to reply to the message <br />\n{social_media_icons} <br>\n{contact_us_url} <br>', 1);
INSERT INTO `tbl_email_templates` (`etpl_code`, `etpl_lang_id`, `etpl_name`, `etpl_subject`, `etpl_body`, `etpl_replacements`, `etpl_status`) VALUES
('catalog_request_message_user', 2, 'إعلام رسالة طلب الكتالوج', 'رسالة جديدة تم تلقيها عند طلب الكتالوج في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">تم نشر الرسالة</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />\r\n					  نشر {username} رسالة عند طلب الكتالوج في <a href=\"{website_url}\">{website_name}</a></h4>              \r\n				<p style=\"margin:0px;\">يتم إعطاء الرسالة كما يلي:</p>                \r\n				<p style=\"margin:0px;\">{message}</p>                \r\n				<p style=\"margin:0px;\">يرجى {click_here} للرد على هذه الرسالة.</p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} - اسم جهاز استقبال البريد الإلكتروني<br/>\n{username} اسم المستخدم للشخص الذي نشر رسالة.<br />\n{request_number} طلب رقم الرسالة التي تم نشرها.<br />\nنص الرسالة {message}/التعليقات المرسلة من المرسل<br />\n{click_here} الارتباط للرد على الرسالة <br />\n{social_media_icons}<br>\n{contact_us_url}<br>', 1),
('child_order_status_change', 1, 'Child Order Status Change - Notification', 'Order Item Status Changed at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Order Item Status Changed</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\">Dear {user_full_name} <br />\r\n					Your order item status has been changed to {new_order_status} corresponding to Order Invoice Number {invoice_number}. at <a href=\"{website_url}\">{website_name}</a>.</h4>\r\n				<p style=\"color: #535b61;\">Please find the order information below.</p>            \r\n            </td>\r\n		</tr>\r\n		<tr>\r\n			<td> {shipment_information} </td>        \r\n		</tr>        \r\n		<tr>\r\n			<td> {order_items_table_format} </td>        \r\n		</tr>        \r\n		<tr>\r\n			<td> {order_admin_comments} </td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{user_full_name} Name of the email receiver<br/> \n{new_order_status} New/Current Order Status<br/>\n{invoice_number} - Child Order Invoice Number.<br/>\n{order_items_table_format} - Child Order Items in Tabular Format.<br/>\n{website_name} Name of our website<br>\n{website_url} URL of our website<br>\n{social_media_icons} <br>\n{contact_us_url} <br>\n', 1),
('child_order_status_change', 2, 'تغيير حالة ترتيب الطفل - إعلام', 'تغيير حالة عنصر الأمر عند {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تغيير حالة صنف الأمر</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\">عزيزي {user_full_name}<br />تم تغيير حالة صنف الأمر إلى {new_order_status} مطابقة لرقم فاتورة الطلب {invoice_number}. في <a href=\"{website_url}\">{website_name}</a>.</h4>\r\n				<p style=\"color: #535b61;\">يرجى العثور على معلومات الطلب أدناه.</p>            \r\n            </td>\r\n		</tr>\r\n		<tr>\r\n			<td>{shipment_information}</td>        \r\n		</tr>        \r\n		<tr>\r\n			<td>{order_items_table_format}</td>        \r\n		</tr>        \r\n		<tr>\r\n			<td>{order_admin_comments}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{user_full_name} اسم جهاز استقبال البريد الإلكتروني<br/> \n{new_order_status} حالة الطلب الجديد/الحالي<br/>\n{invoice_number} - رقم فاتورة أمر الطفل.<br/>\n{order_items_table_format} - عناصر ترتيب تابع بتنسيق جدولي.<br/>\n{website_name} اسم موقعنا<br>\n{website_url} URL لموقعنا الإلكتروني<br>\n{social_media_icons}<br>\n{contact_us_url}<br>\n', 1),
('COD_OTP_VERIFICATION', 1, 'COD OTP Verification', 'COD OTP Verification', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">COD OTP Verification</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_name} </strong><br />\r\n					  {OTP} is the OTP for cash on delivery order verification.</h4>                \r\n				<p><a href=\"{website_url}\">{website_name}</a></p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_name} Name of the email receiver.<br>\r\n{OTP} - One Time Password<br>\r\n{website_name} - Name of the website.\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('COD_OTP_VERIFICATION', 2, 'التحقق من COD OTP', 'التحقق من COD OTP', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">التحقق من COD OTP</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_name}</strong><br />\r\n					  {OTP} هو مكتب المدعي العام للنقد عند التحقق من أمر التسليم.</h4>                \r\n				<p><a href=\"{website_url}\">{website_name}</a></p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_name} اسم جهاز استقبال البريد الإلكتروني.<br>\r\n{OTP} - كلمة مرور لمرة واحدة<br>\r\n{website_name} - اسم الموقع.\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('contact_us', 1, 'Contact-Us', 'Contact Us Form Submitted on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Contact Us Data</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Admin </strong><br />\r\n					 {name} has submitted the contact us form on <a href=\"{website_url}\">{website_name}</a>.</h4> </td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"background:#fff;padding:0 30px; text-align:center; color:#999;vertical-align:top;\">\r\n								<table width=\"100%\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n									<tbody>\r\n										<tr>\r\n											<td style=\"padding:20px 0 30px;\">\r\n												<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n													<tbody>\r\n														<tr>\r\n															<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Name</td>\r\n															<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{name}</td>\r\n														</tr>\r\n														<tr>\r\n															<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Email Address<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n															<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{email_address}</td>\r\n														</tr>\r\n														<tr>\r\n															<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Phone Number</td>\r\n															<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{phone_number}</td>\r\n														</tr>\r\n														<tr>\r\n															<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Message</td>\r\n															<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{message}</td>\r\n														</tr>\r\n													</tbody>\r\n												</table></td>\r\n										</tr>\r\n									</tbody>\r\n								</table></td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{name} Name of the person who has submitted the contact form<br />\r\n{email_address} Email Address of the sender<br />\r\n{phone_number} Phone Number of the sender<br />\r\n{message} Additional message sent by sender\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('contact_us', 2, 'اتصل بنا', 'اتصل بنا نموذج المقدمة على {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">اتصل بنا البيانات</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي المشرف </strong><br />\r\n					 قدمت {name} نموذج الاتصال بنا على <a href=\"{website_url}\">{website_name}</a>.</h4></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"background:#fff;padding:0 30px; text-align:center; color:#999;vertical-align:top;\">\r\n								<table width=\"100%\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n									<tbody>\r\n										<tr>\r\n											<td style=\"padding:20px 0 30px;\">\r\n												<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n													<tbody>\r\n														<tr>\r\n															<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">اسم</td>\r\n															<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{name}</td>\r\n														</tr>\r\n														<tr>\r\n															<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">عنوان البريد الإلكتروني<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n															<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{email_address}</td>\r\n														</tr>\r\n														<tr>\r\n															<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">رقم الهاتف</td>\r\n															<td style=\"padding:10