('new_custom_catalog_request_admin', 2, 'طلب كتالوج مخصص جديد - مسؤول', 'طلب كتالوج مخصص جديد على {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">طلب الكتالوج</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي المشرف </strong><br />لقد تلقينا طلب كتالوج جديد على <a href=\"{website_url}\">{website_name}</a>.</h4>\r\n				<p>يرجى الاطلاع على التفاصيل أدناه:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">عنوان الكتالوج</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{request_title}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{website_name} اسم الموقع<br />\r\nعنوان كتالوج {request_title} للكتالوج<br />\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('new_registration_admin', 1, 'New Registration - Admin', 'New Registration on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">New Account Created!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Admin </strong><br />\r\n					 We have received a new registration on <a href=\"{website_url}\">{website_name}</a>. </h4>\r\n				<p>Please find the details below:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Username</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{username}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Email<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{email}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Phone<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{phone}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Name</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{name}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Type</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{user_type}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{website_name} Name of the website<br /> {username} Username of the person registered<br /> {email} Email Address of the person registered<br />{phone} Phone number of the person registered<br /> {name} Name of the person registered<br /> {user_type} Type of the User registered<br /> {social_media_icons} <br> {contact_us_url} <br>', 1),
('new_registration_admin', 2, 'تسجيل جديد - مسؤول', 'تسجيل جديد على {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">حساب جديد تم إنشاؤه!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي المشرف </strong><br />لقد تلقينا تسجيل جديد على <a href=\"{website_url}\">{website_name}. </a></h4>\r\n				<p>يرجى الاطلاع على التفاصيل أدناه:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">اسم المستخدم</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{username}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">البريد الإلكتروني<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{email}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">الهاتف<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{phone}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">اسم</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{name}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">نوع</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{user_type}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{website_name} اسم الموقع<br />اسم المستخدم {username} للشخص المسجل<br />عنوان البريد الإلكتروني {email} للشخص المسجل<br />رقم هاتف {phone} للشخص المسجل<br />{name} اسم الشخص المسجل<br />نوع المستخدم المسجل {user_type}<br />{social_media_icons}<br>{contact_us_url}<br>', 1),
('new_rfq_offer_notification', 1, 'New Offer Submitted', 'New Offer Submitted', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">New Offer is Submitted</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {receiver_user_name} </strong><br />\r\n					  New Offer is Submitted By {sender_user_name} on <a href=\"{website_url}\">{website_name}</a>. </h4>\r\n				<p><a href=\"{rfq_link}\">Click Here to Check the Details</a></p>                \r\n				<p>Below are details of the Request</p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{rfq_details_table}</td>        \r\n		</tr>\r\n	</tbody>\r\n</table>', '{receiver_user_name} Name of the Receiver <br/>\r\n{sender_user_name} Name of Sender <br/>\r\n{rfq_details_table} RFQ Details in Tabular Format <br>\r\n{rfq_link} RFQ Link for seller <br>\r\n{website_name} Name of our website <br>\r\n{website_url} URL of our website <br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1);
INSERT INTO `tbl_email_templates` (`etpl_code`, `etpl_lang_id`, `etpl_name`, `etpl_subject`, `etpl_body`, `etpl_replacements`, `etpl_status`) VALUES
('new_rfq_offer_notification', 2, 'عرض جديد مقدم', 'عرض جديد مقدم', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تم تقديم عرض جديد</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {receiver_user_name}</strong><br />يتم تقديم عرض جديد من قبل {sender_user_name} على <a href=\"{website_url}\">{website_name}</a>.</h4>\r\n				<p><a href=\"{rfq_link}\">انقر هنا للتحقق من التفاصيل</a></p>                \r\n				<p>فيما يلي تفاصيل الطلب</p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{rfq_details_table}</td>        \r\n		</tr>\r\n	</tbody>\r\n</table>', 'اسم {receiver_user_name} جهاز الاستقبال<br/>\r\nاسم المرسل {sender_user_name}<br/>\r\nتفاصيل RFQ {rfq_details_table} بتنسيق جدولي<br>\r\n{rfq_link} RFQ لينك للبائع <br>\r\n{website_name} اسم موقعنا <br>\r\n{website_url} URL لموقعنا الإلكتروني <br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('new_seller_approved_admin', 1, 'New Seller Approval - Admin', 'New Seller Approval on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Seller Approved</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Admin </strong><br />\r\n					 New seller has been registered on <a href=\"{website_url}\">{website_name}</a>. </h4>\r\n				<p>Please find the details below:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Reference Number</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{reference_number}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Username<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{username}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Email</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{email}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Name</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{name}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{website_name} Name of the website<br />\r\n{username} \r\n\r\nUsername of the person registered<br />\r\n{email} Email Address of the person registered<br />\r\n{name} Name of the person sent request<br />\r\n{reference_number} \r\n\r\nReference Number of the request<br />\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>\r\n', 1),
('new_seller_approved_admin', 2, 'موافقة البائع الجديد - المشرف', 'موافقة البائع الجديد على {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">وافق البائع</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي المشرف </strong><br />تم تسجيل البائع الجديد في <a href=\"{website_url}\">{website_name}</a>.</h4>\r\n				<p>يرجى الاطلاع على التفاصيل أدناه:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">الرقم المرجعي</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{reference_number}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">اسم المستخدم<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{username}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">البريد الإلكتروني</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{email}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">اسم</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{name}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{website_name} اسم الموقع<br />\r\n{username} \r\n\r\nاسم المستخدم للشخص المسجل<br />\r\nعنوان البريد الإلكتروني {email} للشخص المسجل<br />\r\n{name} اسم الشخص الذي تم إرساله الطلب<br />\r\n{reference_number} \r\n\r\nالرقم المرجعي للطلب<br />\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>\r\n', 1),
