('product_return', 1, 'Product Return - Vendor Notification', 'Product return request submitted on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Order Return Request Received</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_name} </strong><br />\r\n					{username} has submitted a {return_request_type} request on a product.</h4>\r\n				<p>Please find the details below:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Order Id/Invoice Number</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{child_order_invoice_number}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Product<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_prod_title}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Qty</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_qty}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Request ID</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_request_id}</td>\r\n		