('product_return', 2, 'إرجاع المنتج - إعلام المورد', 'طلب إرجاع المنتج المقدم في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">طلب إرجاع الطلب المستلم</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_name}</strong><br />\r\n					قدمت {username} طلبا {return_request_type} على منتج.</h4>\r\n				<p>يرجى الاطلاع على التفاصيل أدناه:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">رقم معرف الطلب/الفاتورة</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{child_order_invoice_number}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">حاصل الضرب<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_prod_title}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">الكميه</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_qty}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">معرف الطلب</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_request_id}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">نوع الطلب</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_request_type}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">سبب</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_reason}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">التعليقات</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{return_comments}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{user_name} اسم جهاز استقبال البريد الإلكتروني<br />\r\n{username} اسم المستخدم للشخص الذي قدم طلب العودة.<br/>\r\n{return_request_type} - استرداد أو العودة. .<br/>\r\n{return_prod_title} - المنتج الذي يتم وضع طلب إرجاع له.<br />\r\n{return_qty} طلب العودة QTY.<br />\r\n{return_reason} سبب الإرجاع الذي اختاره المشتري.<br />\r\n{return_comments} التعليقات المقدمة من المشتري<br />\r\nرقم طلب إرجاع {return_request_id}<br/>\r\nرقم معرف/فاتورة الطلب {child_order_invoice_number}\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>\r\n\r\n', 1),
('promotion_approval_required_to_admin', 1, 'Approval Required for promotion', 'New Promotion Request  at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">Promotion Approval Request</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Admin </strong><br />\r\n					  New promotion approval request has been  submitted by {user_full_name}  corresponding to Promotion - {promotion_name}.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} - Name of the email receiver.<br/>\r\n{website_name} Name of our website<br>\r\n\r\n\r\n{new_request_status} New Request Status (Approved/Declined) <br>\r\n{promotion_name} Promotion Name<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('promotion_approval_required_to_admin', 2, 'الموافقة المطلوبة للترقية', 'طلب ترقية جديد في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">طلب الموافقة على الترويج</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي المشرف </strong><br />تم تقديم طلب موافقة الترويج الجديد من قبل {user_full_name}  الموافقة على العرض الترويجي - {promotion_name}.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} - اسم جهاز استقبال البريد الإلكتروني.<br/>\r\n{website_name} اسم موقعنا<br>\r\n\r\n\r\n{new_request_status} حالة الطلب الجديد (تمت الموافقة/رفض) <br>\r\nاسم الترويج {promotion_name}<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('promotion_request_status_change', 1, 'Promotion Status Change', 'Your Promotion Request {new_request_status} at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Promotion Approval Request Updated</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong><br />\r\n					 Your promotion approval request has been {new_request_status} corresponding to Promotion - {promotion_name}.</h4></td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} - Name of the email receiver.<br/>\r\n{website_name} Name of our website<br>\r\n\r\n\r\n{new_request_status} New Request Status (Approved/Declined) <br>\r\n{promotion_name} Promotion Name<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('promotion_request_status_change', 2, 'تغيير حالة الترقية', '{new_request_status} طلب الترقية في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تحديث طلب الموافقة على الترقية</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />تم {new_request_status} طلب الموافقة على الترقية الموافقة على العرض الترويجي - {promotion_name}.</h4></td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} - اسم جهاز استقبال البريد الإلكتروني.<br/>\r\n{website_name} اسم موقعنا<br>\r\n\r\n\r\n{new_request_status} حالة الطلب الجديد (تمت الموافقة/رفض) <br>\r\nاسم الترويج {promotion_name}<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('reminder_for_items_in_cart', 1, 'Reminder for items in Cart', 'Reminder for items in Cart', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">{website_name} is missing you!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong><br />\r\n					 Thank you for adding products to your cart.</h4>                \r\n				<p>Proceed to checkout, before someone else grabs your products</p>                \r\n				<p><a href=\"{checkout_url}\" style=\"background-color: #FF3A59;border: none;color: white;padding: 10px 20px;text-align: center;text-decoration: none;display: inline-block;font-size: 16px;margin: 4px 2px;cursor: pointer;\">Proceed to checkout</a></p>                \r\n				<p>Please Check the Details Below : </p>            </td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{products_in_cart_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '', 1),
('reminder_for_items_in_cart', 2, 'تذكير للعناصر الموجودة في سلة التسوق', 'تذكير للعناصر الموجودة في سلة التسوق', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">{website_name} يفتقدك</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />شكرا لك على إضافة منتجات إلى سلة التسوق الخاصة بك.</h4>                \r\n				<p>المضي قدما إلى الخروج، قبل شخص آخر الاستيلاء على المنتجات الخاصة بك</p>                \r\n				<p><a href=\"{checkout_url}\" style=\"background-color: #FF3A59;border: none;color: white;padding: 10px 20px;text-align: center;text-decoration: none;display: inline-block;font-size: 16px;margin: 4px 2px;cursor: pointer;\">المتابعة إلى الخروج</a></p>                \r\n				<p>يرجى التحقق من التفاصيل أدناه : </p>            </td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{products_in_cart_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '', 1),
('reminder_for_items_in_wishlist', 1, 'Reminder for items in wishlist', 'Reminder for items in wishlist', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">{website_name} is missing you!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong><br />\r\n					 We are glad you liked our products.</h4>                \r\n				<p>Kindly check your favorite products by clicking the following link</p>                \r\n				<p><a href=\"{wishlist_url}\" style=\"background-color: #FF3A59;border: none;color: white;padding: 10px 20px;text-align: center;text-decoration: none;display: inline-block;font-size: 16px;margin: 4px 2px;cursor: pointer;\">Check Your Wishlist</a></p>                \r\n				<p>Please Check the Details Below : </p>            </td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{products_in_wishlist_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '', 1);
INSERT INTO `tbl_email_templates` (`etpl_code`, `etpl_lang_id`, `etpl_name`, `etpl_subject`, `etpl_body`, `etpl_replacements`, `etpl_status`) VALUES
('reminder_for_items_in_wishlist', 2, 'تذكير للعناصر في قائمة الأمنيات', 'تذكير للعناصر في قائمة الأمنيات', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">{website_name} يفتقدك</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />نحن سعداء لأنك أحببت منتجاتنا.</h4>                \r\n				<p>يرجى التحقق من المنتجات المفضلة لديك عن طريق النقر على الرابط التالي</p>                \r\n				<p><a href=\"{wishlist_url}\" style=\"background-color: #FF3A59;border: none;color: white;padding: 10px 20px;text-align: center;text-decoration: none;display: inline-block;font-size: 16px;margin: 4px 2px;cursor: pointer;\">تحقق من قائمة أمنياتك</a></p>                \r\n				<p>يرجى التحقق من التفاصيل أدناه : </p>            </td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{products_in_wishlist_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '', 1),
('report_shop', 1, 'Report a shop', 'Report submitted on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Message Posted</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Admin </strong><br />\r\n					 {username} has reported a shop on <a href=\"{website_url}\">{website_name}</a>.</h4> </td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"109\">Shop</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"664\">{shop_name}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\">Reason</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\">{report_reason}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\">Message</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\">{report_message}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{username} Username of the person who submitted the Report<br />\r\n{shop_name} Shop Name<br />\r\n{report_reason} Reason for reported<br />\r\n{report_message} Message submitted by the reporter<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('report_shop', 2, 'الإبلاغ عن متجر', 'التقرير المقدم في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تم نشر الرسالة</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي المشرف </strong><br />\r\n					 وقد أبلغت {username} متجر على <a href=\"{website_url}\">{website_name}</a>.</h4></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"109\">دكان</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"664\">{shop_name}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\">سبب</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\">{report_reason}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\">رسالة</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\">{report_message}</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{username} اسم المستخدم للشخص الذي قدم التقرير<br />\r\nاسم متجر {shop_name}<br />\r\n{report_reason} سبب الإبلاغ<br />\r\nرسالة {report_message} مقدمة من المراسل<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
