('subscription_reminder_email', 2, 'البريد الإلكتروني للتذكير بالاشتراك', 'البريد الإلكتروني للتذكير بالاشتراك', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تذكير الاشتراك!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />ستنتهي صلاحية اشتراكك في اليومين القادمين. يرجى الحفاظ على الحد الأدنى لرصيد محفظتك لمواصلة اشتراكك <a href=\"{website_url}\">على{website_name}</a></h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} اسم جهاز استقبال البريد الإلكتروني.<br>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL/رابط موقعنا الإلكتروني<br>\r\nرابط الإحالة {tracking_url}\r\n{invitation_message}<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('subscription_renew_admin', 1, 'Admin - Subscription Renew', 'Subscription Renewed at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Subscription Reminder!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong>  your Subscription is going to be expire in next 2 days. Kindly maintain your minimum wallet balance to continue your subscription on <a href=\"{website_url}\">{website_name}</a>.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{website_name} Name of our website<br>\r\n{invoice_number} Invoice Number of the Order<br>\r\n{new_order_status} New Order Status<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('subscription_renew_admin', 2, 'مسؤول - تجديد الاشتراك', 'تجديد الاشتراك في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تذكير الاشتراك!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong> اشتراكك ستنتهي صلاحيته في اليومين القادمين. يرجى الحفاظ على الحد الأدنى لرصيد محفظتك لمواصلة اشتراكك على <a href=\"{website_url}\">{website_name}. </a></h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{website_name} اسم موقعنا<br>\r\nرقم الفاتورة {invoice_number} للأمر<br>\r\nحالة طلب جديد {new_order_status}<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('subscription_renew_user', 1, 'Renew Subscription Plan', 'Subscription Renewed at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Subscription Renew</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_name} </strong><br />\r\n					 your subscription has been renewed corresponding to Order Invoice Number - {invoice_number} at <a href=\"{website_url}\">{website_name}</a>.</h4>                \r\n				<p>Please Check the Details Below : </p>            </td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{order_products_table_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{website_name} Name of our website<br>\r\n{user_full_name} User Name <br>\r\n{invoice_number} Invoice Number of the Order<br>\r\n{new_order_status} New Order Status<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('subscription_renew_user', 2, 'تجديد خطة الاشتراك', 'تجديد الاشتراك في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تجديد الاشتراك</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_name}</strong><br />تم تجديد اشتراكك المطابق لرقم فاتورة الطلب - {invoice_number} عند <a href=\"{website_url}\">{website_name}</a>.</h4>                \r\n				<p>يرجى التحقق من التفاصيل أدناه : </p>            </td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{order_products_table_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{website_name} اسم موقعنا<br>\r\nاسم المستخدم {user_full_name}<br>\r\nرقم الفاتورة {invoice_number} للأمر<br>\r\nحالة طلب جديد {new_order_status}<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('supplier_request_status_change_buyer', 1, 'Buyers - Seller Request Status Change', 'Your Seller Request {new_request_status} at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">Seller Approval Request Status Updated</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_full_name} </strong><br />\r\n					  Your seller approval request has been {new_request_status} corresponding to Reference Number - {reference_number}.{request_comments}</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} - Name of the email receiver.<br/>\r\n{website_name} Name of our website<br>\r\n\r\n\r\n{new_request_status} New Request Status (Approved/Declined) <br>\r\n{reference_number} Reference Number of the request<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('supplier_request_status_change_buyer', 2, 'المشترين - تغيير حالة طلب البائع', '{new_request_status} طلب البائع الخاص بك في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">تحديث حالة طلب موافقة البائع</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_full_name}</strong><br />تم {new_request_status} طلب موافقة البائع الخاص بك الموافقة على الرقم المرجعي - {reference_number}.{request_comments}</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_full_name} - اسم جهاز استقبال البريد الإلكتروني.<br/>\r\n{website_name} اسم موقعنا<br>\r\n\r\n\r\n{new_request_status} حالة الطلب الجديد (تمت الموافقة/رفض) <br>\r\nرقم مرجع الطلب {reference_number}<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('taxapi_order_creation_failure', 1, 'TaxApi Order Creation Failure Email', 'TaxApi Order Creation Failed at {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">TaxApi Order Creation Failure</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Admin </strong> <br />\r\n					System has tried to create an order/transaction on TaxApi after order is marked as completed by admin, but not able to create an Order/Transaction on TaxApi due to below Error on your site  <a href=\"{website_url}\">{website_name}</a> with Yo!Rent Order Invoice Number {invoice_number}.</h4>                \r\n				<p>Please find the TaxApi Error information below.</p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td style=\"padding:0 0 30px;\">{error_message}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{invoice_number} - YoRent Order Invoice Number.<br/>\r\n{website_name} Name of our website<br>\r\n{website_url} URL of our website<br>\r\n{error_message} -  Error Message received from TaxApi while creating order \r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('taxapi_order_creation_failure', 2, 'البريد الإلكتروني فشل إنشاء أمر TaxApi', 'فشل إنشاء أمر TaxApi في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">فشل إنشاء أمر TaxApi</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي المشرف</strong><br />حاول النظام إنشاء أمر / معاملة على TaxApi بعد وضع علامة على الطلب على أنه مكتمل من قبل المشرف ، ولكنه غير قادر على إنشاء أمر / معاملة على TaxApi بسبب الخطأ أدناه على موقعك  <a href=\"{website_url}\">{website_name}</a> مع Yo! رقم فاتورة أمر الإيجار {invoice_number}.</h4>                \r\n				<p>الرجاء العثور على معلومات الخطأ TaxApi أدناه.</p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td style=\"padding:0 0 30px;\">{error_message}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{invoice_number} - رقم فاتورة طلب YoRent.<br/>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL لموقعنا الإلكتروني<br>\r\n{error_message} - رسالة خطأ تم تلقيها من TaxApi أثناء إنشاء أمر \r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('test_email', 1, 'Test Email', 'Test Email', '<table width=\"100%\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n    <tr>\r\n        <td style=\"background:#ff3a59;\"><br />\r\n            \r\n            <!--\r\n            page title end here\r\n            -->\r\n               </td>\r\n    </tr>\r\n    <tr>\r\n        <td>\r\n            <!--\r\n            page body start here\r\n            -->\r\n               \r\n            <table width=\"600\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td style=\"background:#fff;padding:0 30px; text-align:center; color:#999;vertical-align:top;\">\r\n                            <table width=\"100%\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n                                <tbody>\r\n                                    <tr>\r\n                                        <td style=\"padding:20px 0 30px;\"><span style=\"font-size: 18px; font-weight: bold; color: rgb(51, 51, 51);\">This is the test email &nbsp;from&nbsp;</span>&nbsp;<a href=\"{website_url}\">{website_name}</a>.</td>\r\n                                    </tr>\r\n                                    <tr>\r\n                                        <td style=\"padding:20px 0 30px;\"><br />\r\n                                            </td>\r\n                                    </tr>\r\n                                    <tr>\r\n                                        <td style=\"padding:0 0 30px;\"><br />\r\n                                            </td>\r\n                                    </tr>\r\n                                    \r\n                                </tbody>\r\n                            </table></td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            <!--\r\n            page body end here\r\n            -->\r\n               </td>\r\n    </tr>\r\n</table>', '\r\n{website_name} Name of our website<br>\r\n', 1),
('threshold_notification_vendor', 1, 'Threshold Level Notification - Seller', 'Product threshold level achieved on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Product Stock Alert</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {shop_name}  </strong><br />\r\n					 Your product {prod_title} has achieved threshold level on <a href=\"{website_url}\">{website_name}</a> Please {click_here} to refill stock quantity.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{shop_name} Shop Name<br />\r\n{prod_title} Name of the product<br />\r\n{website_name} Name of the website<br />\r\n{click_here} Click here Link to update inventory.\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('threshold_notification_vendor', 2, 'الإخطار مستوى العتبة - البائع', 'مستوى عتبة المنتج الذي تم تحقيقه على {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">تنبيه مخزون المنتج</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {shop_name}  </strong><br />حققت {prod_title} المنتج مستوى العتبة على <a href=\"{website_url}\">{website_name}</a> يرجى {click_here} لإعادة ملء كمية المخزون.</h4>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', 'اسم متجر {shop_name}<br />\r\n{prod_title} اسم المنتج<br />\r\n{website_name} اسم الموقع<br />\r\n{click_here} انقر هنا الارتباط لتحديث المخزون.\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1);
INSERT INTO `tbl_email_templates` (`etpl_code`, `etpl_lang_id`, `etpl_name`, `etpl_subject`, `etpl_body`, `etpl_replacements`, `etpl_status`) VALUES
('threshold_notification_vendor_custom', 1, 'Custom Threshold Level Notification - Seller', '{admin_subject}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                \r\n				<h2 style=\"font-size:32px;margin:15px 0\">Product Stock Alert</h2>                \r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_name} </strong><br />\r\n					 </h4>                \r\n				<p style=\"margin:0px;\">Your product {prod_title} has achieved threshold level on <a href=\"{website_url}\">{website_name}</a> Please {click_here} to refill stock quantity.</p>                \r\n				<p style=\"margin:0px;\">{admin_message}</p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{user_name} Name of the email receiver<br />\r\n{prod_title} Name of the product<br />\r\n{website_name} Name of the website<br />\r\n{click_here} Click here Link to update inventory.\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>\r\n{admin_message} Message to append\r\n{admin_subject} Subject of email', 1),
