('vendor_digital_order_email', 1, 'Vendor Digital Order Email', 'Digital Order Received From {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Order Placed</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {vendor_name} </strong> <br />\r\n					An order has been placed for your Digital product(s) at <a href=\"{website_url}\">{website_name}</a></h4>                \r\n				<p>Please Share the downloadable link  and other Credentials with the user at Email : {order_user_email} </p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{order_items_table_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{vendor_name} Name of the vendor<br/>\r\n{website_name} Name of our website<br>\r\n{website_url} URL of our website<br>\r\n{order_items_table_format} Order items in Tabular Format.<br>\r\n{order_user_email} Buyer Email Address\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('vendor_digital_order_email', 2, 'البريد الإلكتروني للطلب الرقمي للمورد', 'الطلب الرقمي المستلم من {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">ترتيب وضع</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {vendor_name}</strong><br />تم طلب منتجك الرقمي (منتجاتك) في <a href=\"{website_url}\">{website_name}</a></h4>                \r\n				<p>يرجى مشاركة الرابط القابل للتنزيل وبيانات الاعتماد الأخرى مع المستخدم على البريد الإلكتروني : {order_user_email}</p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{order_items_table_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{vendor_name} اسم المورد<br/>\r\n{website_name} اسم موقعنا<br>\r\n{website_url} URL لموقعنا الإلكتروني<br>\r\n{order_items_table_format} ترتيب العناصر بتنسيق جدولي.<br>\r\n{order_user_email} عنوان البريد الإلكتروني للمشتري\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1),
('vendor_order_email', 1, 'Vendor Order Email', 'Order Received From {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Order Placed</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {vendor_name} </strong> <br />\r\n					An order has been placed for your product(s) at <a href=\"{website_url}\">{website_name}</a></h4>                \r\n				<p>Order details and Shipping information are given below:</p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{order_items_table_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{vendor_name} Name of the vendor<br/>\n{website_name} Name of our website<br>\n{website_url} URL of our website<br>\n{order_items_table_format} Order items in Tabular Format.<br>\n{social_media_icons} <br>\n{contact_us_url} <br>', 1),
('vendor_order_email', 2, 'البريد الإلكتروني لطلب المورد', 'الطلب المستلم من {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\"> \r\n                <img src=\"{website_url}/images/sent.png\" style=\"display: block; margin: 20px auto 0; max-width: 42px\" />\r\n				<h2 style=\"font-size:32px;margin:15px 0\">ترتيب وضع</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {vendor_name}</strong><br />تم طلب منتجك (منتجاتك) في <a href=\"{website_url}\">{website_name}</a></h4>                \r\n				<p>وترد أدناه تفاصيل الطلب ومعلومات الشحن:</p></td>\r\n		</tr>        \r\n		<tr>            \r\n			<td>{order_items_table_format}</td>        \r\n		</tr>    \r\n	</tbody>\r\n</table>', '{vendor_name} اسم المورد<br/>\n{website_name} اسم موقعنا<br>\n{website_url} URL لموقعنا الإلكتروني<br>\n{order_items_table_format} ترتيب العناصر بتنسيق جدولي.<br>\n{social_media_icons}<br>\n{contact_us_url}<br>', 1),
('welcome_registration', 1, 'Welcome Mail on Registration', 'Welcome to {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Account Created!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {name}  </strong>  Thank you for signing up at <a href=\"{website_url}\">{website_name}</a>.</h4>                \r\n				<p>We are thrilled to have you aboard! You have taken a great first step and we are so excited to connect directly with you.</p>                \r\n				<p>If you require any assistance in using our site, or have any feedback or suggestions, you can email us at {contact_us_email}</p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{name} Name of the signed up user.<br>\r\n{email} Email Address of the signed up user.<br>\r\n{username} Username of the signed up User <br/>\r\n{contact_us_email} - Contact Us Email Address<br/>\r\n{website_name} Name of our website<br>\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>\r\n', 1),
('welcome_registration', 2, 'بريد الترحيب على التسجيل', 'مرحبا بكم في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">حساب تم إنشاؤه!</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {name}  </strong>  شكرا لكم على الاشتراك في <a href=\"{website_url}\">{website_name}. </a></h4>                \r\n				<p>نحن سعداء أن يكون لك على متن الطائرة! لقد اتخذت خطوة أولى رائعة ونحن متحمسون للغاية للتواصل معك مباشرة.</p>                \r\n				<p>إذا كنت بحاجة إلى أي مساعدة في استخدام موقعنا، أو لديك أي ملاحظات أو اقتراحات، يمكنك مراسلتنا عبر البريد الإلكتروني على {contact_us_email}</p>            </td>\r\n		</tr>    \r\n	</tbody>\r\n</table>', '{name} اسم المستخدم الموقع.<br>\r\n{email} عنوان البريد الإلكتروني للمستخدم الموقع.<br>\r\nاسم المستخدم {username} للمستخدم الموقع<br/>\r\n{contact_us_email} - اتصل بنا عنوان البريد الإلكتروني<br/>\r\n{website_name} اسم موقعنا<br>\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>\r\n', 1),
('withdrawal_request_admin', 1, 'Withdrawal Request - Admin', 'Withdrawal Request on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Withdrawal Request Received</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear Admin </strong> {username} has submitted a withdrawal request on {website_name}. </h4>\r\n				<p>Please find the details below:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Request ID</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{request_id}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">Amount<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{request_amount}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" colspan=\"2\">Withdrawal details are as below:</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n		<tr>\r\n			<td>{withdrawal_detail_table_format_html}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{username} Username of the person submitted the withdrawal request<br />\r\n{website_name} Name of the website<br />\r\n{request_id} Withdrawal Request ID<br />\r\n{request_amount} Withdrawal Request Amount<br />\r\n{social_media_icons} <br>\r\n{withdrawal_detail_table_format_html}: Withdrawal Payment Details like Bank Details, Cheque Details, PayPal Details etc\r\n{contact_us_url} <br>', 1),
('withdrawal_request_admin', 2, 'طلب السحب - مسؤول', 'طلب السحب على {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">طلب السحب المستلم</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي المشرف </strong> {username} قدم طلب سحب على {website_name}. </h4>\r\n				<p>يرجى الاطلاع على التفاصيل أدناه:</p></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"border:1px solid #ddd; border-collapse:collapse;\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">معرف الطلب</td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{request_id}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" width=\"153\">مبلغ<span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></td>\r\n							<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"620\">{request_amount}</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"padding:10px;font-size:13px;border:1px solid #ddd; color:#333; font-weight:bold;\" colspan=\"2\">تفاصيل السحب كما يلي:</td>\r\n						</tr>\r\n					</tbody>\r\n				</table></td>\r\n		</tr>\r\n		<tr>\r\n			<td>{withdrawal_detail_table_format_html}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{username} اسم المستخدم للشخص المقدم طلب السحب<br />\r\n{website_name} اسم الموقع<br />\r\nمعرف طلب السحب {request_id}<br />\r\nمبلغ طلب السحب {request_amount}<br />\r\n{social_media_icons}<br>\r\n{withdrawal_detail_table_format_html}: تفاصيل الدفع السحب مثل تفاصيل البنك، تفاصيل الشيك، تفاصيل PayPal الخ\r\n{contact_us_url}<br>', 1),
('withdrawal_request_approved_declined', 1, 'Withdrawal Request Approved/Declined Email for User', 'Fund Withdrawal Request {request_status} on {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">Withdrawal Request Status Updated</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">Dear {user_name} </strong>  Your fund withdrawal request {request_id} of {request_amount} has been {request_status} on <a href=\"{website_url}\">{website_name}</a>.</h4> </td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{user_name} Name of the email receiver<br />\r\n{request_id} Withdrawal Request ID<br />\r\n{request_amount} Withdrawal Request Amount.<br />\r\n{request_status} New Withdrawal Request Status<br />\r\n{website_name} Name of the website\r\n{social_media_icons} <br>\r\n{contact_us_url} <br>', 1),
('withdrawal_request_approved_declined', 2, 'طلب السحب الموافق عليه/ المرفوض للبريد الإلكتروني للمستخدم', '{request_status} طلب سحب الأموال في {website_name}', '\r\n<table width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color: #f9f9f9; padding: 30px;text-align:center;line-height:1.5\">\r\n				<h2 style=\"font-size:32px;margin:15px 0\">حالة طلب السحب محدثة</h2>\r\n				<h4 style=\"font-size: 20px;color:#535b61\"><strong style=\"font-size:18px;color:#333;\">عزيزي {user_name}</strong>  تم {request_status} طلب سحب الأموال {request_id} {request_amount} في <a href=\"{website_url}\">{website_name}. </a></h4></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '{user_name} اسم جهاز استقبال البريد الإلكتروني<br />\r\nمعرف طلب السحب {request_id}<br />\r\n{request_amount} مبلغ طلب السحب.<br />\r\n{request_status} حالة طلب سحب جديدة<br />\r\n{website_name} اسم الموقع\r\n{social_media_icons}<br>\r\n{contact_us_url}<br>', 1);
