(16, 'Seller Page Block 1', 16, 0, 1, 0, '<div class=\"row\"> 				        <div class=\"col-lg-6 col-md-6 col-sm-12 col-xs-12\"> 				            <div class=\"growth\" style=\"background-image:url(images/customer.png);\"><strong>5+</strong><br> 				                Millions Customers 				            </div> 				            <div class=\"growth\" style=\"background-image:url(images/bussiness.png);\"><strong>1000+</strong><br> 				                Business Growing rapidly with us 				            </div> 				        </div> 				        <div class=\"col-lg-6 col-md-6 col-sm-12 col-xs-12\"> 				            <ul class=\"growth-txt\"> 				                <li> 				                    <i class=\"icn\"><img src=\"images/star-unique.png\" alt=\"\"></i> 				                    <h4>Consectetur adipisicing</h4> 				                    <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do 				                        incididunt ut labore et dolore magna aliqua. 				                    </p> 				                </li> 				                <li> 				                    <i class=\"icn\"><img src=\"images/folder.png\" alt=\"\"></i> 				                    <h4>Consectetur adipisicing</h4> 				                    <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do 				                        incididunt ut labore et dolore magna aliqua. 				                    </p> 				                </li> 				            </ul> 				        </div> 				    </div>'),
(17, 'Seller Page Block 2', 17, 0, 1, 0, '<div class=\"heading1\">Simple steps to start selling online</div> <div class=\"seller-steps\"> 	<ul> 		<li> 			<i class=\"icn\"><img src=\"/images/easyto-use.png\" alt=\"\"></i> 			<h3>Easy to Use</h3> 			<p>Set up simulation exercises for large group of students in a few steps.</p> 		</li> 		<li> 			<i class=\"icn\"><img src=\"/images/real-market.png\" alt=\"\"></i> 			<h3>Real Market Data</h3> 			<p>Use real financial markets data in simulation activities.</p> 		</li> 		<li> 			<i class=\"icn\"><img src=\"/images/simulated.png\" alt=\"\"></i> 			<h3>Simulated Market Data</h3> 			<p>Simulate past market events and data over a specific historical time period.</p> 		</li> 		<li> 			<i class=\"icn\"><img src=\"/images/customization.png\" alt=\"\"></i> 			<h3>Fully Customisable</h3> 			<p>Fully customise activities to meet various learning outcomes, disciplines and levels of difficulty.</p> 		</li> 	</ul> </div>'),
(18, 'Seller slogan Text', 18, 0, 1, 0, '<h3>Selling on YoRent is easy! <span class=\"\">All you need is:</span> </h3> <ul>   	<li><i class=\"fa fa-check\" aria-hidden=\"true\"></i> VAT Number </li>   	<li><i class=\"fa fa-check\" aria-hidden=\"true\"></i> PAN Card </li>   	<li><i class=\"fa fa-check\" aria-hidden=\"true\"></i> Current Account Number </li> </ul>'),
(20, 'Account Subscription Page', 20, 0, 1, 0, '<h3>Simple Pricing With No Surprises</h3>           <p>Subscription plans and At vero eos et accusamus et iusto odio dignissimos<br /> 	            ducimus qui blanditiis quas molestias excepturi sint occaecati cupiditate non provident. </p>'),
(21, 'Advertiser slogan Text', 21, 0, 1, 0, '<h3>Make Money <span class=\"\">by becoming a Yo!Rent Affiliate!</span></h3> <p>Our affiliate program is easy & free to join! It enables you to earn revenue by referring potential customers to our website. Whether you are a large content network, social media butterfly or a seasoned blogger, you can earn our standard 5.00% commission on referred purchases. For more information, please visit our FAQ page and don’t forget to read our Terms & Conditions.</p>'),
(23, 'Checkout Page', 23, 0, 1, 0, ''),
(24, 'Become Seller Page Form Text', 24, 0, 1, 0, ''),
(25, 'Seller page Block 3', 25, 0, 1, 0, '<div class=\"heading1\">Simple Pricing Structure</div> <div class=\"pricing-structure\">   	<ul> 		<li>10%   			<p>Commission Fee</p></li> 		<li class=\"sign\">+</li> 		<li>$1   			<p>Shipping Fee</p></li> 		<li class=\"sign\">+</li> 		<li>$4    			<p>Marketplace Fee</p></li> 		<li class=\"sign\">+</li> 		<li>15%    			<p>Service Tax</p></li> 		<li class=\"sign\">+</li> 		<li>Amt.    			<p>Amount You Earned</p></li> 		<li class=\"sign\">=</li> 		<li>Price    			<p>Price You Decide</p></li>   	</ul></div> <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum voluptatem.</p><a href=\"#\" class=\"btn btn--primary btn--custom\">Learn More About Pricing</a>'),
(28, 'Admin Product Categories', 28, 1, 1, 0, '<div>&nbsp;</div> <div> 	<h1>Categories Content File</h1><br /> 	</div> <h3>Category Identifier</h3> <div>User defined free text field for unique identifier of the category. This works as a unique key for the system to identify a particular category.</div> <div><br /> 	</div> <h3>Parent Identifier</h3> <div>Parent Identifier is used for categories that belong to a root/master category, essentially they are subcategories to root categories. For a category that is root/master category the parent identifier needs to be left blank.</div> <div><br /> 	</div> <div>  </div> <h3>Name</h3> <div>User defined name for the category.</div> <div><br /> 	</div> <div>&nbsp;</div> <h3>Description</h3> <div>User defined description for the category.</div> <div><br /> 	</div> <div>&nbsp;</div> <h3>SEO Friendly URL</h3> <div>User defined URL for the category for SEO purposes. Spaces cannot be used in the URL.</div> <div><br /> 	</div> <div> </div> <h3>Featured</h3> <div>User defined field to mark a particular category as featured or not. Possible inputs for this field are ‘Yes’ &amp; ‘No’.</div> <div>&nbsp;</div> <div> </div> <h3>Active</h3> <div>User defined field to mark a particular category as active in the system or not. Possible inputs for this field are ‘Yes’ &amp; ‘No’. Default value should be set as ’Yes’.</div> <div>&nbsp;</div> <div> </div> <h3>Display Order</h3>User defined field to set priority on display order of root categories or sub-categories within a root category. If more than one category has display order set to the same value then the system will display category that was added first. If you are unsure about this field add display order as ‘1’ to all the categories.     <h3>&nbsp;</h3> <h3>Deleted</h3>User defined field to mark a particular category as deleted in the system or not. Possible inputs for this field are ‘Yes’ &amp; ‘No’. Default value should be set as ’No’ to display categories in the system.  <h1>&nbsp;</h1> <h1>Categories Media File</h1> <h3>&nbsp;</h3> <h3>Category Identifier</h3>User defined unique identifier for the category. This field needs to be the same as Category Identifier defined in Categories Content sheet.    <h3>&nbsp;</h3> <h3>Lang Code</h3>User defined field to link the category image for a particular language. ‘Universal’ is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the Category has different images for each language.  <h3>&nbsp;</h3> <h3>Image Type</h3>User defined field with input options of ‘Category Icon’ &amp; ‘Category Banner’. Category icon option is to be used when uploading icon image for the category. Category banner option is to be used when uploading banner image for the category page.    <h3>&nbsp;</h3> <h3>File Path</h3>File path needs to be a publically accessible URL for example URL’s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded. Preferred image dimensions for Category Icon are 60*60 pixels. Preferred image dimensions for Category banner are 1050*340 pixels.  <h3>&nbsp;</h3> <h3>File Name</h3>Name of the image file  <h3>&nbsp;</h3> <h3>Display order</h3>When a category has multiple images then this field defines the order of display. If you are unsure about this field add display order as ‘1’ to all the categories.'),
(29, 'General Settings', 29, 1, 1, 0, '<br />  <h3>Multilingual</h3>Since Yo!Rent inherently is a multilingual platform all export-import functionality where ever available in the system will only work for the particular language exported or imported in. This means that a file that is exported in English will only update English values when imported back into the system. Same items in other languages will not be updated until the user exports the same CSV in other languages makes changes and imports it back to the system.<br />  <h3>Import/Export process</h3>As a practice it is always recommended to export the CSV first make changes to it and then import it back into the system. This practice will insure accuracy of the CSV file and minimize any errors during import.<br />  <h3>Images/Media Files</h3>Any type of images/media can only be imported into the system if the file is located at a public URL. For example the file should be hosted either on a server which is accessible publically or on online tools such as Dropbox/Google Drive etc. Please note that images saved on devices and desktops cannot be imported through the CSV.<br /> Once the media CSV is imported in to the system, a cron job is executed by the system to import and save the images on the server. This cron job is an automated script that the system runs after a set interval on its own and no intervention is required from the users end. The media/images imported into the system will not display immediately.<br />  <h3>Deleting Items</h3>Within Yo!Rent when an item is deleted, the system does not actually delete the item from the database rather it just hides the item from display. With the import functionality a user can restore a previously deleted item by changing the value of the deleted column from ‘Yes’ to ‘No’.<br />   <h3>Import Log File</h3>Yo!Rent will generate a CSV log file for every import action where it will log the column and row for the errors encountered during the import. If the import was successful then no log file will be generated. System will only allow importing the CSV if no errors are encountered.<br />  <h3>CSV</h3>To avoid errors it is absolutely recommended to not alter columns or its names/headers in the CSV. Also to import bulk entries it is absolutely recommended to keep maximum entries to a count of 20,000 per sheet. It is absolutely recommended to make multiple sheets for data above 20,000.<br />  <h3>Import Export Yo!Rent Settings</h3>Only turn on/off settings from the settings console if you are familiar with boolean concepts and understand how \'id\'s\' will work in a CSV. Also turning on settings from the import export settings tab may alter or add columns to the CSV. These columns are not defined in the instructions tab.&nbsp;<br />'),
(30, 'Admin Brands', 30, 1, 1, 0, '<h2>&nbsp;</h2> <h2>Brands Content File</h2> <h3>&nbsp;</h3> <h3>Brand Identifier</h3>User defined unique identifier for the Brand. This works as a unique key for the system to identify a particular Brand. <h3>&nbsp;</h3> <h3>Name</h3>User defined name for the Brand in the system.  <h3>&nbsp;</h3> <h3>Description</h3>User defined description for the Brand. <h3>&nbsp;</h3> <h3>SEO Friendly URL</h3> User defined URL for the Brand for SEO purposes. Spaces cannot be used in the URL.  <h3>&nbsp;</h3> <h3>Featured</h3>User defined field to mark a particular Brand as featured or not. Possible inputs for this field are \'Yes\' &amp; \'No\'.  <h3>&nbsp;</h3> <h3>Active</h3>User defined field to mark a particular category as active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\'.  <h2>&nbsp;</h2> <h2>Brands Media File</h2> <h3>&nbsp;</h3> <h3>Brand Identifier</h3>User defined unique identifier for the Brand. This field needs to be the same as Brand Identifier defined in Brands Content sheet.    <h3>&nbsp;</h3> <h3>Lang Code</h3>User defined field to link the brand image for a particular language. \'Universal\' is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the Brand has different images for each language.  <h3>&nbsp;</h3> <h3>File Path</h3>File path needs to be a publicly accessible URL for example URL\'s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded. Preferred image dimensions are 192*82 pixels. <h3>&nbsp;</h3> <h3>File Name</h3>Name of the image file  <h3>&nbsp;</h3> <h3>Display order</h3>When a brand has multiple images then this field defines the order of display. If you are unsure about this field add display order as \'1\' to all the brands.'),
(31, 'Admin Options', 31, 1, 1, 0, '<h2><br /> 	<br /> 	Options Content File</h2> <h3>&nbsp;</h3> <h3>Option Identifier</h3>User defined unique identifier for the Option. This works as a unique key for the system to identify a particular Option. <h3>&nbsp;</h3> <h3>Option Name</h3>User defined name for the Option. <h3>&nbsp;</h3> <h3>Username</h3>For admin this field needs to be left blank. In case an option is added by a seller then seller username will be displayed in this field.   <h3>&nbsp;</h3> <h3>Is separate image</h3>User defined input field to denote if the option would have a separate image. Useful for color options of the product. Possible inputs for this field are \'Yes\' &amp; \'No\'.     <h3>&nbsp;</h3> <h3>Is color type</h3>User defined input field to denote if option is a color. Possible inputs for this field are \'Yes\' &amp; \'No\'. <h3>&nbsp;</h3> <h3>Display in filters</h3>User defined input field to denote if option is to be displayed in the filters on the product listing page. Possible inputs for this field are \'Yes\' &amp; \'No\'. <h3>&nbsp;</h3> <h3>Deleted</h3>User defined field to mark a particular option as deleted in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'No\' to display categories in the system. <h2>&nbsp;</h2> <h2>Options Values File</h2> <h3>&nbsp;</h3> <h3>Option value identifier</h3>User defined unique identifier for the Option value. This works as a unique key for the system to identify a particular Option value. <h3>&nbsp;</h3> <h3>Option Identifier</h3>User defined unique identifier for the option. This field value needs to be the same as the Option Identifier defined in Options Content sheet.    <h3>&nbsp;</h3> <h3>Option Value</h3>User defined value for the Option.  <h3>&nbsp;</h3> <h3>Color code</h3>User defined Hexadecimal value for the color of the option. Only to be used if the option is a color. Leave this field blank if the option is not a color. Hexadecimal for a color can be searched on Google.   <h3>&nbsp;</h3> <h3>Display order</h3>When an option has multiple option values then this field defines the order of display of the option value. If you are unsure about this field add display order as \'1\'.'),
(32, 'Admin Tags', 32, 1, 1, 0, '<h2><br /> 	<br /> 	Tags Content File</h2> <h3><br /> 	<br /> 	Tag Identifier</h3>User defined unique identifier for the Tag. This works as a unique key for the system to identify a particular Tag. <h3><br /> 	<br /> 	Username</h3>For admin this field needs to be left blank. In case a tag is added by a seller then seller username will be displayed in this field.   <h3><br /> 	<br /> 	Tag name</h3>User defined name for the Tag.'),
(33, 'Admin Countries Management', 33, 1, 1, 0, '<br />  <h2>Countries Content File </h2>  <h3><br /> 	<br /> 	Country Code</h3>User defined field for unique country code.  <h3><br /> 	<br /> 	Country Name</h3>User defined field for unique country name.  <h3><br /> 	<br /> 	Currency Code</h3>User defined field for unique currency code for the country.  <h3><br /> 	<br /> 	Language Code</h3>Language code for the country can be input here. \'Universal\' is to be used as an option if there is no preference, else relevant language code needs to be associated with the country. For example we will use \'ENG\' for the United States.   <h3><br /> 	<br /> 	Active</h3>User defined field to mark a particular country as active in the system or not. Possible inputs for this field are \'Yes\' & \'No\'. Default value should be set as \'Yes\'.'),
(34, 'Admin State Management', 34, 1, 1, 0, '<br />  <h2>States Content File</h2>  <h3><br /> 	<br /> 	State Identifier</h3>User defined unique identifier for the State. This works as a unique key for the system to identify a particular State. <h3><br /> 	<br /> 	Country Code</h3>This field needs to be the same as country code defined in Countries Content sheet.    <h3><br /> 	<br /> 	Sate Name</h3>User defined field for unique state name. <h3><br /> 	<br /> 	State Code</h3>User defined field for unique state code. <h3><br /> 	<br /> 	Active</h3>User defined field to mark a particular state as active in the system or not. Possible inputs for this field are \'Yes\' & \'No\'. Default value should be set as \'Yes\'.'),
(35, 'Admin Manage Catalog', 35, 1, 1, 0, '<div class=\"grouplisting\">                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Product Catalog Content </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<h5>Product Identifier</h5>                                     			<p>User defined unique identifier for the Product. This works as a unique key for the system to identify a particular Product.</p>                                     			<h5>Username</h5>                                     			<p>For admin this field needs to be left blank. In case an option is added by a seller then seller username will be displayed in this field.  </p>                                     			<h5>Name</h5>                                     			<p>User defined field for product name.</p>                                     			<h5>Description</h5>                                     			<p>User defined field for product description. </p>                                     			<h5>Youtube video</h5>                                     			<p>User defined field for product Youtube video URL</p>                                     			<h5>Category Identifier</h5>                                     			<p> User defined unique identifier for the category. This field needs to be the same as Category Identifier defined in Categories Content sheet.  </p>                                     			<h5>Brand Identifier</h5>                                     			<p>User defined unique identifier for the Brand. This field needs to be the same as Brand Identifier defined in Brand Content sheet.  </p>                                     			<h5>Product Type Identifier</h5>                                     			<p>User defined input field to denote the type of the Product. Possible inputs for this field are \'Physical\' &amp; \'Digital\'. </p>                                     			<h5>Model</h5>                                     			<p>User defined field for product model.</p>                                     			<h5>Minimum selling price</h5>                                     			<p>User defined field for minimum selling price for the product.</p>                                     			<h5>Tax Category Identifier</h5>                                     			<p>User defined unique identifier for the Tax category. This field needs to be the same as Tax Category Identifier defined in the Admin console under the Sales Tax option page.</p>                                     			<h5>Length</h5>                                     			<p>User defined field for product package length.</p>                                     			<h5>Width</h5>                                     			<p>User defined field for product package width.</p>                                                                          			<h5>Height</h5>                                     			<p>User defined field for product package Height.</p>                                                                          			<h5>Dimension Unit Identifier</h5>                                     			<p>User defined input field to denote the unit of the dimensions of the package. Possible inputs for this field are \'Inch\', \'Centimeter\' &amp; \'Feet\'. </p>                                                                          			<h5>Weight </h5>                                     			<p>User defined field for product package Weight.</p>                                     			<h5>Weight Unit Identifier</h5>                                     			<p>User defined input field to denote the unit of the weight of the package. . Possible inputs for this field are \'Gram\', \'Kilogram\' &amp; \'Pound\'.</p>                                     			<h5>Ean/upc Code</h5>                                     			<p>User defined field for EAN/UPC code of the product.</p>                                     			<h5>Shipping country Code</h5>                                     			<p>This field needs to be the same as country code defined in Countries Content sheet.  </p>                                     			<h5>Added On</h5>                                     			<p>User defined field for product add date to the system.</p>                                     			<h5>Free Shipping</h5>                                     			<p>User defined field to mark a particular Product is available for free shipping. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                     			<h5>COD Available</h5>                                     			<p>User defined field to mark a particular Product is available for Cash on Delivery or not. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                     			<h5>Featured</h5>                                     			<p>User defined field to mark a particular Product as featured or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                     			<h5>Approved</h5>                                     			<p>User defined field to mark a particular Product as Approved or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\' to display products in the system.</p>                                     			<h5>Active</h5>                                     			<p>User defined field to mark a particular Product as active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\'. </p>                                     			<h5>Deleted</h5>                                     			<p>User defined field to mark a particular product as deleted in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'No\' to display products in the system. </p>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Product Option Content </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                              				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet. </p>                                    </li>                                                                              				<li>                                                                                      					<h5>Option Identifier</h5>                                                                                      					<p>User defined unique identifier for the Option. This field needs to be the same as Option Identifier defined in Option Content sheet. </p>                                        </li>                                                                      			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Product Tag Content</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                              				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet.</p>                                    </li>                                                                              				<li>                                                                                      					<h5>Tag Identifier</h5>                                                                                      					<p>User defined unique identifier for the Tag. This field needs to be the same as Tag Identifier defined in Tag Content sheet. </p>                                    </li>                                                                      			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Product Specification Content </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                              				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet.    </p>                                    </li>                                                                              				<li>                                                                                      					<h5>Lang Code</h5>                                                                                      					<p>User defined field to link the product specification for a particular language. Language codes can be looked up by clicking the language option in the top header. </p>                                    </li>                                                                              				<li>                                                                                      					<h5>Specification Name</h5>                                                                                      					<p>User defined field for product specification name.</p>                                    </li>                                                                              				<li>                                                                                      					<h5>Specification Value</h5>                                                                                      					<p>User defined field for product specification Value.</p>                                    </li>                                                                      			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Product Shipping Content </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                          				<li>                                                                                  					<h5>Product Identifier</h5>                                                                                  					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet.</p>                                    </li>                                                                          				<li>                                                                                  					<h5>Username</h5>                                                                                  					<p>For admin this field needs to be left blank. In case an option is added by a seller then seller username will be displayed in this field. </p>                                    </li>                                                                          				<li>                                                                                  					<h5>Shipping Country Code</h5>                                                                                  					<p>This field needs to be the same as country code defined in Countries Content sheet. This field can be left blank if the product has no restrictions on the countries it is shipped to.</p>                                    </li>                                                                          				<li>                                                                                  					<h5>Shipping Company Identifier</h5>                                                                                  					<p>User defined unique identifier for the Shipping company identifier. This field needs to be the same as the Shipping Company Identifier defined in the Admin console>Shipping API>Shipping Companies page.  </p>                                        </li>                                                                          				<li>                                                                                  					<h5>Shipping Duration Identifier</h5>                                                                                  					<p>User defined unique identifier for the Shipping Duration identifier. This field needs to be the same as the Shipping Duration Identifier defined in the Admin console>Shipping API>Duration Labels page. </p>                                    </li>                                                                          				<li>                                                                                  					<h5>Cost</h5>                                                                                  					<p>User defined field for product shipping cost.</p>                                    </li>                                                                          				<li>                                                                                  					<h5>Additional Item Cost</h5>                                                                                  					<p>User defined field for additional shipping cost per product.</p>                                    </li>                                                                  			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Product Catalog Media  </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                          				<li>                                                                                  					<h5>Product Identifier</h5>                                                                                  					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet. </p>                                    </li>                                                                          				<li>                                                                                  					<h5>Lang Code</h5>                                                                                  					<p>User defined field to link the product image for a particular language. \'Universal\' is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the Product has different images for each language.</p>                                    </li>                                                                          				<li>                                                                                  					<h5>Option Identifier</h5>                                                                                  					<p>User defined unique identifier for the option. This field value needs to be the same as the Option Identifier defined in Options Content sheet.   </p>                                    </li>                                                                          				<li>                                                                                  					<h5>Option value Identifier</h5>                                                                                  					<p>User defined unique identifier for the option value. This field value needs to be the same as the Option value Identifier defined in Options Value Content sheet. </p>                                    </li>                                                                          				<li>                                                                                  					<h5>File Path</h5>                                                                                  					<p>File path needs to be a publically accessible URL for example URL\'s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded. Preferred image dimensions for the product images are greater than 500*500 pixels. </p>                                    </li>                                                                          				<li>                                                                                  					<h5>File Name</h5>                                                                                  					<p>Name of the image file. </p>                                    </li>                                                                          				<li>                                                                                  					<h5>Display order</h5>                                                                                  					<p>When a product has multiple images then this field defines the order of display. If you are unsure about this field add display order as \'1\'. </p>                                    </li>                                                                  			</ul>                                </div>                            </div>                        </div>');
INSERT INTO `tbl_extra_pages` (`epage_id`, `epage_identifier`, `epage_type`, `epage_content_for`, `epage_active`, `epage_default`, `epage_default_content`) VALUES
(36, 'Seller Manage Catalog', 36, 1, 1, 0, '<div class=\"grouplisting\">                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Catalog – Product Catalog </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Product Identifier </h5>                                                                                      					<p>User defined unique identifier for the Product. This works as a unique key for the system to identify a particular Product.</p>                                        </li>                                         				<li>                                                                                      					<h5>Username </h5>                                                                                      					<p>For admin this field needs to be left blank. In case a product is added by a seller then seller username will be displayed in this field.  </p>                                        </li>                                            				<li>                                                                                      					<h5>Name </h5>                                                                                      					<p>User defined field for product name.</p>                                        </li>                                            				<li>                                                                                      					<h5>Description </h5>                                                                                      					<p>User defined field for product description. er</p>                                        </li>                                            				<li>                                                                                      					<h5>Youtube video</h5>                                                                                      					<p>User defined field for product Youtube video URL. </p>                                        </li>                                            				<li>                                                                                      					<h5>Category Identifier</h5>                                                                                      					<p>User defined unique identifier for the category. This field needs to be the same as the Category Identifier defined in Categories export sheet.   </p>                                        </li>                                            				<li>                                                                                      					<h5>Brand Identifier</h5>                                                                                      					<p>User defined unique identifier for the Brand. This field needs to be the same as Brand Identifier defined in Brand  sheet.   </p>                                        </li>                                            				<li>                                                                                      					<h5>Product Type Identifier</h5>                                                                                      					<p>User defined input field to denote the type of the Product. Possible inputs for this field are \'Physical\' &amp; \'Digital\'. </p>                                        </li>                                            				<li>                                                                                      					<h5>Model </h5>                                                                                      					<p>User defined field for product model.</p>                                        </li>                                            				<li>                                                                                      					<h5>Minimum selling price</h5>                                                                                      					<p>User defined field for minimum selling price for the product.</p>                                        </li>                                            				<li>                                                                                      					<h5>Tax Category Identifier</h5>                                                                                      					<p>User defined unique identifier for the Tax category. This field needs to be the same as Tax Category Identifier defined in tax category export sheet.   </p>                                        </li>                                            				<li>                                                                                      					<h5>Length</h5>                                                                                      					<p>User defined field for product package length.</p>                                        </li>                                            				<li>                                                                                      					<h5>Width</h5>                                                                                      					<p>User defined field for product package width.</p>                                        </li>                                            				<li>                                                                                      					<h5>Height</h5>                                                                                      					<p>User defined field for product package Height.</p>                                        </li>                                            				<li>                                                                                      					<h5>Dimension Unit Identifier </h5>                                                                                      					<p> User defined input field to denote the unit of the dimensions of the package. Possible inputs for this field are \'Inch\', \'Centimeter\' &amp; \'Feet\'.    </p>                                        </li>                                            				<li>                                                                                      					<h5>Weight </h5>                                                                                      					<p>User defined field for product package Weight.</p>                                        </li>                                                                                     				<li>                                                                                      					<h5>Weight Unit Identifier</h5>                                                                                      					<p>User defined input field to denote the unit of the weight of the package. . Possible inputs for this field are \'Gram\', \'Kilogram\' &amp; \'Pound\'. </p>                                        </li>                                            				<li>                                                                                      					<h5>Ean/upc Code</h5>                                                                                      					<p>User defined field for EAN/UPC code of the product.</p>                                        </li>                                            				<li>                                                                                      					<h5>Shipping country Code</h5>                                                                                      					<p>This field needs to be the same as country code defined in Countries export sheet.   </p>                                        </li>                                            				<li>                                                                                      					<h5>Free Shipping </h5>                                                                                      					<p>User defined field to mark a particular Product is available for free shipping. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                        </li>                                            				<li>                                                                                      					<h5>COD Available</h5>                                                                                      					<p>User defined field to mark a particular Product is available for Cash on Delivery or not. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                        </li>                                            				<li>                                                                                      					<h5>Featured</h5>                                                                                      					<p>User defined field to mark a particular Product as featured or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         				<li>                                                                                      					<h5>Approved </h5>                                                                                      					<p>User defined field to mark a particular Product as Approved or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\' to display products in the system.</p>                                        </li>                                            				<li>                                                                                      					<h5>Active </h5>                                                                                      					<p>User defined field to mark a particular Product as active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\'. </p>                                        </li>                                            				<li>                                                                                      					<h5>Deleted </h5>                                                                                      					<p>User defined field to mark a particular product as deleted in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'No\' to display products in the system. </p>                                        </li>                                        			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Catalog - Product Option </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p> User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.    </p>                                        </li>                                         				<li>                                                                                      					<h5>Option Identifier</h5>                                                                                      					<p>User defined unique identifier for the Option. This field needs to be the same as Option Identifier defined in Option export sheet.</p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Catalog - Product Tags</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.    </p>                                        </li>                                           				<li>                                                                                      					<h5>Tag Identifier</h5>                                                                                      					<p>User defined unique identifier for the Tag. This field needs to be the same as tag Identifier defined in tags export sheet.</p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Catalog - Product Specifications</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.    </p>                                        </li>                                            				<li>                                                                                      					<h5>Lang Code</h5>                                                                                      					<p>User defined field to link the product specification for a particular language. Language codes can be looked up by clicking the language option in the top header. </p>                                        </li>                                             				<li>                                                                                      					<h5>Specification Name</h5>                                                                                      					<p>User defined field for product specification name.</p>                                        </li>                                             				<li>                                                                                      					<h5>Specification Value</h5>                                                                                      					<p>User defined field for product specification Value.</p>                                        </li>                                         			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Catalog - Product Shipping</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p> User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.    </p>                                        </li>                                           				<li>                                                                                      					<h5>Username</h5>                                                                                      					<p>For admin this field needs to be left blank. In case an option is added by a seller then seller username will be displayed in this field.  </p>                                        </li>                                         				<li>                                                                                      					<h5>Shipping Country Code</h5>                                                                                      					<p>This field needs to be the same as country code defined in the Countries export sheet. </p>                                        </li>                                         				<li>                                                                                      					<h5>Shipping Company Identifier</h5>                                                                                      					<p>User defined unique identifier for the Shipping company identifier. This field needs to be the same as the Shipping Company Identifier defined in the Admin console>Shipping API>Shipping Companies page. Please contact the admin for details.     </p>                                        </li>                                         				<li>                                                                                      					<h5>Shipping Duration Identifier</h5>                                                                                      					<p>User defined unique identifier for the Shipping Duration identifier. This field needs to be the same as the Shipping Duration Identifier defined in the Admin console>Shipping API>Duration Labels page. Please contact the admin for details.</p>                                        </li>                                         				<li>                                                                                      					<h5>Cost</h5>                                                                                      					<p>User defined field for product shipping cost.</p>                                        </li>                                         				<li>                                                                                      					<h5>Additional Item Cost </h5>                                                                                      					<p>User defined field for additional shipping cost per product.</p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Catalog - Product Media</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.</p>                                        </li>                                           				<li>                                                                                      					<h5>Lang Code</h5>                                                                                      					<p>User defined field to link the image for a particular language. \'Universal\' is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the product has different images for each language.</p>                                        </li>                                           				<li>                                                                                      					<h5>Option Identifier</h5>                                                                                      					<p>User defined unique identifier for the Option. This field needs to be the same as Option Identifier defined in Option export sheet.    </p>                                        </li>                                           				<li>                                                                                      					<h5>Option Value Identifier</h5>                                                                                      					<p>User defined unique identifier for the Option value. This field needs to be the same as the Option value Identifier defined in the Option value export sheet.    </p>                                        </li>                                           				<li>                                                                                      					<h5>File Path</h5>                                                                                      					<p>File path needs to be a publically accessible URL for example URL\'s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded.</p>                                        </li>                                           				<li>                                                                                      					<h5>File Name</h5>                                                                                      					<p>Name of the image file</p>                                        </li>                                           				<li>                                                                                      					<h5>Display order</h5>                                                                                      					<p>When a product has multiple images then this field defines the order of display. If you are unsure about this field add display order as \'1\'. </p>                                        </li>                                       			</ul>                                </div>                            </div>                        </div>'),
(37, 'Seller Import General Settings', 37, 1, 1, 0, '<br />  <h3>Multilingual</h3>Since Yo!Rent inherently is a multilingual platform all export-import functionality where ever available in the system will only work for the particular language exported or imported in. This means that a file that is exported in English will only update English values when imported back into the system. Same items in other languages will not be updated until the user exports the same CSV in other languages makes changes and imports it back to the system.<br />  <h3>Import/Export process</h3>As a practice it is always recommended to export the CSV first make changes to it and then import it back into the system. This practice will insure accuracy of the CSV file and minimize any errors during import.<br />  <h3>Images/Media Files</h3>Any type of images/media can only be imported into the system if the file is located at a public URL. For example the file should be hosted either on a server which is accessible publically or on online tools such as Dropbox/Google Drive etc. Please note that images saved on devices and desktops cannot be imported through the CSV.<br /> Once the media CSV is imported in to the system, a cron job is executed by the system to import and save the images on the server. This cron job is an automated script that the system runs after a set interval on its own and no intervention is required from the users end. The media/images imported into the system will not display immediately.<br />  <h3>Deleting Items</h3>Within Yo!Rent when an item is deleted, the system does not actually delete the item from the database rather it just hides the item from display. With the import functionality a user can restore a previously deleted item by changing the value of the deleted column from \'Yes\' to \'No\'.<br />   <h3>Import Log File</h3>Yo!Rent will generate a CSV log file for every import action where it will log the column and row for the errors encountered during the import. If the import was successful then no log file will be generated. System will only allow importing the CSV if no errors are encountered.<br />  <h3>CSV</h3>To avoid errors it is absolutely recommended to not alter columns or its names/headers in the CSV. Also to import bulk entries it is absolutely recommended to keep maximum entries to a count of 20,000 per sheet. It is absolutely recommended to make multiple sheets for data above 20,000.<br />  <h3>Import Export Yo!Rent Settings</h3>Only turn on/off settings from the settings console if you are familiar with boolean concepts and understand how id\'s will work in a CSV.&nbsp;Also turning on settings from the import export settings tab may alter or add columns to the CSV. These columns are not defined in the instructions tab.&nbsp;<br />');
INSERT INTO `tbl_extra_pages` (`epage_id`, `epage_identifier`, `epage_type`, `epage_content_for`, `epage_active`, `epage_default`, `epage_default_content`) VALUES
(38, 'Products Inventory - Admin', 38, 1, 1, 0, '<div class=\"grouplisting\">                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – General Data  </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined unique id for the Product. This field needs to be unique.</p>                                        </li>                                           				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p>User defined identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet. </p>                                        </li>                                         				<li>                                                                                      					<h5>Username</h5>                                                                                      					<p>Username of the seller to which inventory is being updated.</p>                                        </li>                                         				<li>                                                                                      					<h5>Selling price</h5>                                                                                      					<p>Selling price of the product </p>                                        </li>                                         				<li>                                                                                      					<h5>Stock</h5>                                                                                      					<p>Quantity available for the product </p>                                        </li>                                         				<li>                                                                                      					<h5>Min Order Quantity</h5>                                                                                      					<p>Minimum quantity that a buyer can purchase for the product</p>                                        </li>                                         				<li>                                                                                      					<h5>Subtract Stock</h5>                                                                                      					<p>User defined field to mark if the system should subtract stock or not once an order is placed. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                        </li>                                         				<li>                                                                                      					<h5>Track Inventory</h5>                                                                                      					<p>User defined field to mark if the system should monitor inventory or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         				<li>                                                                                      					<h5>Threshold Stock Level</h5>                                                                                      					<p>User defined field to input threshold stock level upon which the system would generate an alert email. This will only work if both Subtract Stock &amp; Track Inventory are set as \'Yes\'.</p>                                        </li>                                         				<li>                                                                                      					<h5>Condition identifier</h5>                                                                                      					<p> User defined field to define a particular product\'s condition in the system. Possible inputs for this field are \'New\', \'Used\' &amp; \'Refurbished\'.</p>                                        </li>                                         				<li>                                                                                      					<h5>Digital Product Max Download time</h5>                                                                                      					<p>User defined field to define maximum number of times a digital product can be downloaded. Possible inputs for this field are integers.</p>                                        </li>                                         				<li>                                                                                      					<h5>Download validity in days</h5>                                                                                      					<p>User defined field to define maximum number of days until the digital product can be downloaded. Possible inputs for this field are integers.</p>                                        </li>                                         				<li>                                                                                      					<h5>Title</h5>                                                                                      					<p>User defined field to define the title of the product in the shop. </p>                                        </li>                                         				<li>                                                                                      					<h5>Comments</h5>                                                                                      					<p> User defined field to input comments for the product.</p>                                        </li>                                                                                  				<li>                                                                                      					<h5>URL Keyword</h5>                                                                                      					<p>User defined field for input of URL keywords, used for URL rewriting.&nbsp;&nbsp;</p>                                        </li>                                         				<li>                                                                                      					<h5>Added on </h5>                                                                                      					<p>User defined date field to input the date the product is added into the system. Date format is mm/dd/yy</p>                                        </li>                                         				<li>                                                                                      					<h5>Available from </h5>                                                                                      					<p> User defined date field to input the date the product is available from. Date format is mm/dd/yy</p>                                        </li>                                         				<li>                                                                                      					<h5>Active</h5>                                                                                      					<p>User defined field to mark a particular product as Active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\' to display products in the system.</p>                                        </li>                                         				<li>                                                                                      					<h5>COD Available</h5>                                                                                      					<p>User defined field to mark a particular product is available for cash on delivery in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         				<li>                                                                                      					<h5>Deleted</h5>                                                                                      					<p>User defined field to mark a particular product as deleted in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'No\' to display products in the system.</p>                                        </li>                                         				<li>                                                                                      					<h5>Sold count</h5>                                                                                      					<p>System defined field to show the user cold count for a particular product. This field cannot be updated by the user.</p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Product Options  </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id </h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                           				<li>                                                                                      					<h5>Option Identifier</h5>                                                                                      					<p>User defined unique identifier for the Option. This field needs to be the same as the option identifier defined in the Options content sheet.</p>                                        </li>                                            				<li>                                                                                      					<h5>Option Value Identifier</h5>                                                                                      					<p>User defined unique identifier for the Option value. This field needs to be the same as the option value identifier defined in the Options value content sheet.</p>                                        </li>                                        			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – SEO Data </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.  </p>                                        </li>                                         				<li>                                                                                      					<h5>Meta Identifier</h5>                                                                                      					<p>User defined unique identifier for the Meta data. This works as a unique key for the system to identify a particular Meta data.</p>                                        </li>                                             				<li>                                                                                      					<h5>Meta Title</h5>                                                                                      					<p>User defined input field for the user to define Meta title for the product.</p>                                        </li>                                             				<li>                                                                                      					<h5>Meta Keywords</h5>                                                                                      					<p>User defined input field for the user to define Meta keywords for the product.</p>                                        </li>                                             				<li>                                                                                      					<h5>Meta Description</h5>                                                                                      					<p>User defined input field for the user to define Meta Description for the product.</p>                                        </li>                                             				<li>                                                                                      					<h5>Other Meta Tags </h5>                                                                                      					<p>User defined input field for the user to define other Meta tags for the product.</p>                                        </li>                                         			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Special Price</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id </h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.  </p>                                        </li>                                           				<li>                                                                                      					<h5>Start Date</h5>                                                                                      					<p>User defined date field to input the date from which the special price of the product starts from. Date format is mm/dd/yy</p>                                        </li>                                         				<li>                                                                                      					<h5>End Date</h5>                                                                                      					<p>User defined date field to input the date from which the special price of the product ends on. Date format is mm/dd/yy</p>                                        </li>                                         				<li>                                                                                      					<h5>Price</h5>                                                                                      					<p>User defined field for special price of the product. </p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Volume Discount </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                           				<li>                                                                                      					<h5>Min Quantity</h5>                                                                                      					<p>User defined field for minimum quantity of the product to be purchased for volume discount.</p>                                        </li>                                           				<li>                                                                                      					<h5>Discount Percentage</h5>                                                                                      					<p>User defined field for discount percentage to be applied to the product in case of the volume discount. </p>                                        </li>                                       			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Buy Together </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                           				<li>                                                                                      					<h5>Buy Together Selprod Id</h5>                                                                                      					<p>User defined product identifier for the buy together related Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                       			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Related Products </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                           				<li>                                                                                      					<h5>Related Selprod Id</h5>                                                                                      					<p>User defined product identifier for the related Products. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Seller Product Policy  </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id </h5>                                                                                      					<p> User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         				<li>                                                                                      					<h5>Policy Point Identifier</h5>                                                                                      					<p>User defined policy point identifier for the Product. This field needs to be the same as the policy point identifier defined on the Policy Points Management page under the CMS tab in the admin console. </p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Media  </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                            				<li>                                                                                      					<h5>Lang Code</h5>                                                                                      					<p>User defined field to link the image for a particular language. \'Universal\' is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the product has different images for each language.</p>                                        </li>                                         				<li>                                                                                      					<h5>File Path</h5>                                                                                      					<p>File path needs to be a publically accessible URL for example URL\'s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded.</p>                                        </li>                                         				<li>                                                                                      					<h5>File Name</h5>                                                                                      					<p>Name of the image file </p>                                        </li>                                         				<li>                                                                                      					<h5>Display order</h5>                                                                                      					<p>When a product has multiple images then this field defines the order of display. If you are unsure about this field add display order as \'1\'.</p>                                        </li>                                     			</ul>                                </div>                            </div>                        </div>'),
(39, 'Products Inventory - Seller', 39, 1, 1, 0, '<div class=\"grouplisting\">                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – General Data </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined unique id for the Product. This field needs to be unique.</p>                                        </li>                                         				<li>                                                                                      					<h5>Product Identifier</h5>                                                                                      					<p>User defined identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.  </p>                                        </li>                                         				<li>                                                                                      					<h5>Selling price </h5>                                                                                      					<p>Selling price of the product</p>                                        </li>                                         				<li>                                                                                      					<h5>Stock</h5>                                                                                      					<p>Quantity available for the product </p>                                        </li>                                         				<li>                                                                                      					<h5>Min Order Quantity</h5>                                                                                      					<p>Minimum quantity that a buyer can purchase for the product</p>                                        </li>                                         				<li>                                                                                      					<h5>Subtract Stock</h5>                                                                                      					<p>User defined field to mark if the system should subtract stock or not once an order is placed. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         				<li>                                                                                      					<h5>Track Inventory</h5>                                                                                      					<p> User defined field to mark if the system should monitor inventory or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         				<li>                                                                                      					<h5>Threshold Stock Level </h5>                                                                                      					<p>User defined field to input threshold stock level upon which the system would generate an alert email. This will only work if both Subtract Stock &amp; Track Inventory are set as \'Yes\'.</p>                                        </li>                                         				<li>                                                                                      					<h5>Condition identifier </h5>                                                                                      					<p>User defined field to define a particular product\'s condition in the system. Possible inputs for this field are \'New\', \'Used\' &amp; \'Refurbished\'.</p>                                        </li>                                         				<li>                                                                                      					<h5>Digital Product Max Download time</h5>                                                                                      					<p>User defined field to define maximum number of times a digital product can be downloaded. Possible inputs for this field are integers.</p>                                        </li>                                         				<li>                                                                                      					<h5>Download validity in days</h5>                                                                                      					<p>User defined field to define maximum number of days until the digital product can be downloaded. Possible inputs for this field are integers.</p>                                        </li>                                         				<li>                                                                                      					<h5>Title </h5>                                                                                      					<p>User defined field to define the title of the product in the shop. </p>                                        </li>                                         				<li>                                                                                      					<h5>Comments</h5>                                                                                      					<p>User defined field to input comments for the product.</p>                                        </li>                                         				<li>                                                                                      					<h5>URL Keyword</h5>                                                                                      					<p>&nbsp;User defined field for input of URL keywords, used for URL rewriting.&nbsp;&nbsp;</p>                                        </li>                                         				<li>                                                                                      					<h5>Available from</h5>                                                                                      					<p>User defined date field to input the date the product is available from. Date format is mm/dd/yy</p>                                        </li>                                         				<li>                                                                                      					<h5>Active</h5>                                                                                      					<p>User defined field to mark a particular product as Active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\' to display products in the system.</p>                                        </li>                                         				<li>                                                                                      					<h5>COD Available</h5>                                                                                      					<p>User defined field to mark a particular product is available for cash on delivery in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                                                              			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Product Options</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                          				<li>                                                                                      					<h5>Option Identifier</h5>                                                                                      					<p>User defined unique identifier for the Option. This field needs to be the same as Option Identifier defined in Option export sheet. </p>                                        </li>                                          				<li>                                                                                      					<h5>Option Value Identifier</h5>                                                                                      					<p>User defined unique identifier for the Option value. This field needs to be the same as Option Value Identifier defined in Option Value export sheet.</p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – SEO</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id </h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                         				<li>                                                                                      					<h5>Meta Identifier</h5>                                                                                      					<p>User defined unique identifier for the Meta data. This works as a unique key for the system to identify a particular Meta data.</p>                                        </li>                                         				<li>                                                                                      					<h5>Meta Title</h5>                                                                                      					<p>User defined input field for the user to define Meta title for the product. </p>                                        </li>                                         				<li>                                                                                      					<h5>Meta Keywords</h5>                                                                                      					<p>User defined input field for the user to define Meta keywords for the product.</p>                                        </li>                                         				<li>                                                                                      					<h5>Meta Description</h5>                                                                                      					<p>User defined input field for the user to define Meta Description for the product.</p>                                        </li>                                         				<li>                                                                                      					<h5>Other Meta Tags </h5>                                                                                      					<p>User defined input field for the user to define other Meta tags for the product.</p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Special Price </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         				<li>                                                                                      					<h5>Start Date</h5>                                                                                      					<p>User defined date field to input the date from which the special price of the product starts from. Date format is mm/dd/yy</p>                                        </li>                                         				<li>                                                                                      					<h5>End Date</h5>                                                                                      					<p>User defined date field to input the date from which the special price of the product ends on. Date format is mm/dd/yy</p>                                        </li>                                         				<li>                                                                                      					<h5>Price</h5>                                                                                      					<p>User defined field for special price of the product. </p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Volume Discount </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         				<li>                                                                                      					<h5>Min Quantity </h5>                                                                                      					<p>User defined field for minimum quantity of the product to be purchased for volume discount.</p>                                        </li>                                         				<li>                                                                                      					<h5>Discount Percentage </h5>                                                                                      					<p>User defined field for discount percentage to be applied to the product in case of the volume discount. </p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Buy Together </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id </h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         				<li>                                                                                      					<h5>Buy Together Selprod Id</h5>                                                                                      					<p>User defined product identifier for the buy together related Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5>  Seller Products – Related Products</h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         				<li>                                                                                      					<h5>Related Selprod Id</h5>                                                                                      					<p>User defined product identifier for the related Products. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.  </p>                                        </li>                                     			</ul>                                </div>                            </div>                             	<div class=\"groups group-js\">                                 		<div class=\"group__head group__head-js\"> 			<h5> Seller Products – Seller Product Policy </h5></div>                                 		<div class=\"group__body group__body-js\">                                     			<ul>                                                                      				<li>                                                                                      					<h5>Seller Product Id</h5>                                                                                      					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         				<li>                                                                                      					<h5>Policy Point Identifier </h5>                                                                                      					<p> User defined policy point identifier for the Product. This field needs to be the same as the policy point identifier defined on the Policy Points Management page under the CMS tab in the admin console. </p>                                        </li>                                     			</ul>                                </div>                            </div>                        </div>'),
(40, 'Product Inventory Update Instructions', 40, 1, 1, 0, '<h4><br /> 	<br /> 	Seller Product Id</h4>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.     <h4><br /> 	SKU</h4>User defined field for the product SKU. <h4><br /> 	Product</h4>User defined field for the product name. <h4><br /> 	Price</h4>User defined field for the product price. <h4><br /> 	Stock/quantity</h4>User defined field for the stock/quantity of the product.'),
(44, 'Policy points', 44, 1, 1, 0, ''),
(45, 'Marketplace Product Instructions', 41, 0, 1, 0, '<div class=\"delivery-term-data-inner\">\r\n                <div class=\"heading\">Products<span>All the information you need regarding this page</span></div>\r\n                <ul class=\"\">\r\n                    <li>\r\n                        This page lists all the marketplace products added by admin and seller.\r\n                        Marketplace products are of two types:-\r\n                        <ul>\r\n                            <li><strong>System Products</strong>: Available to all sellers and any seller can add to their own store.</li>\r\n                            <li><strong>My Products</strong>: Available only for you. No other seller can add to their own store.</li>\r\n                        </ul>\r\n                    </li>\r\n                    <li>On clicking \"<strong>Add Product</strong>\" button, seller can add new product to marketplace products.</li>\r\n                    <li>On click of \"<strong>Add to Store</strong>\" the seller can pick the product and add the products to his store inventory.</li>\r\n                </ul>\r\n            </div>'),
(46, 'Seller Inventory Instructions', 42, 0, 1, 0, '<div class=\"delivery-term-data-inner\">\r\n                    <div class=\"heading\">Store Inventory<span>All the information you need regarding this page</span></div>\r\n                    <ul>\r\n                        <li>This tab lists all the products available to your front end store.</li>\r\n                        <li>For each product variant, separate copy need to be created by seller either from Marketplace product tab or clone product icon.</li>\r\n                        <li>To add new product to your store inventory, seller will have to pick the products from the marketplace products tabs from \"Add to Store\" button</li>\r\n                    </ul>\r\n                </div>'),
(47, 'Product Request Instructions', 43, 0, 1, 0, '<div class=\"delivery-term-data-inner\">\r\n                    <div class=\"heading\">Requested Products<span>All the information you need regarding this page</span></div>\r\n                    <ul>\r\n                        <li>This tab lists all the products requested by seller to the admin which are not available in the marketplace products.</li>\r\n                        <li>On admin approval, the product will be added to the marketplace products and to the seller inventory.</li>\r\n                    </ul>\r\n                </div>');
INSERT INTO `tbl_extra_pages` (`epage_id`, `epage_identifier`, `epage_type`, `epage_content_for`, `epage_active`, `epage_default`, `epage_default_content`) VALUES
(48, 'Custom Fields Import Instructions for Admin', 45, 1, 1, 0, '<h3>Custom Fields Content File</h3><h5>Field Name</h5><p>User-defined name for the Custom Field. A field name cannot be repeated within the same Field Group. In such a case, the system will generate an error.</p><br><h5>Field Type</h5><p>Select the type of data to be entered for this field.<br>Number<br>Decimal<br>Drop-down Select Box<br>Checkboxes<br>Text</p><br><h5>Option Data/ Attribute Options</h5><p>Only displayed when creating ‘Drop-Down’ or ‘Checkboxes’ custom fields.<br>Enter the options to be displayed for users to choose from. Enter multiple options and separate them using Vertical Bar Pipe \"|\" symbol from your keyboard.</p><br><h5>Postfix</h5><p>Enter the text that shall be displayed post each value entered for this custom field. For example, the custom field is created is ‘Length’ whose value shall be entered in numeric format and its measuring unit is ‘Meters’. So, ‘Meters’ can be entered in the postfix field.</p><br><h5>Field Group Id</h5><p>User-defined group Id. Please enter the same id number for the same group names.</p><br><h5>Field Group Name</h5><p>Create groups to display custom fields under separate sections. In case if this field is left empty, the custom field will be displayed in a default group named ‘Others’.</p><br><h5>Display In Filter</h5><p>Enter ‘Yes’ to display the custom field as a filter for the buyers at the front-end. Otherwise enter \"No\".</p><br><h5>Category Id</h5><p>Enter category Id.</p><br><h5>Active</h5><p>User-defined field to mark a particular state as active in the system or not. Possible inputs for this field are \"Yes\" &amp; \"No\". The default value should be set as \"Yes\".</p>');
