(21, 1, 'Advertiser slogan Text', '<h3>Advertise With us<br />\r\n	</h3>                \r\n<p>YoRent advertising offers a great value to brands with the ability to target their commertial messaging using different categories and search keywords. Our Advertising Platform provides an in-depth knowledge of e-commerce audience. This will help you to connect with our exclusive user base through various Advertising models like Standard Banners.</p>'),
(21, 2, 'Advertiser slogan Text', '<h3>Advertise With Us</h3>                \r\n<p>YoRent advertising offers a great value to brands with the ability to target their commertial messaging using different categories and search keywords. Our Advertising Platform provides an in-depth knowledge of e-commerce audience. This will help you to connect with our exclusive user base through various Advertising models like Standard Banners.</p>'),
