(25, 1, 'Seller page Block 3', '<div class=\"section-head section--white--head section--head--center mb-0\">                        \r\n	<div class=\"section__heading\">                            \r\n		<h2>Simple Pricing Structure</h2>                        </div>                    </div>\r\n<div class=\"pricing-structure\">  \r\n	<ul>\r\n		<li>10%  \r\n			<p>Commission Fee</p></li>\r\n		<li class=\"sign\">+</li>\r\n		<li>$1  \r\n			<p>Shipping Fee</p></li>\r\n		<li class=\"sign\">+</li>\r\n		<li>$4   \r\n			<p>Marketplace Fee</p></li>\r\n		<li class=\"sign\">+</li>\r\n		<li>15%   \r\n			<p>Service Tax</p></li>\r\n		<li class=\"sign\">+</li>\r\n		<li>Amt.   \r\n			<p>Amount You Earned</p></li>\r\n		<li class=\"sign\">=</li>\r\n		<li>Price   \r\n			<p>Price You Decide</p></li>  \r\n	</ul></div>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum voluptatem.</p><a href=\"#\" class=\"btn btn--primary btn--custom\">Learn More About Pricing</a>'),
(25, 2, 'صفحة البائع بلوك 3', '<div class=\"heading1\">بسيطة التسعير هيكل</div>\r\n<div class=\"pricing-structure\">\r\n	<ul>\r\n		<li>10%\r\n			<p>رسوم العمولة</p></li>\r\n		<li class=\"sign\">+</li>\r\n		<li>$1\r\n			<p>رسوم الشحن</p></li>\r\n		<li class=\"sign\">+</li>\r\n		<li>$4\r\n			<p>رسوم السوق</p></li>\r\n		<li class=\"sign\">+</li>\r\n		<li>15%\r\n			<p>ضريبة الخدمة</p></li>\r\n		<li class=\"sign\">+</li>\r\n		<li>AMT.\r\n			<p>المبلغ الذي ربحته</p></li>\r\n		<li class=\"sign\">=</li>\r\n		<li>السعر\r\n			<p>السعر الذي تقرره</p></li>\r\n	</ul></div>\r\n<p>لوريم إيبسوم دولور سيت أميت، كونسكتيتور أديبيسيسينغ إليت، سيد دو إيسمود تيمبور إنسيدونت أوت لابور إت دولور ماغنا أليكوا. أوت إنيم أد مينيم فينيام، كويس نوسترود إكسيرسيساتيون أولامكو لابوريس نيسي أوت أليكيب إكس إي كومودو ثوسكات. دويس أوت إيرور دولور إن ريبرهندريت إن فولوبتات فيليت إيس سيلوم فولوبتاتم.</p><a href=\"http://YoRent-v8.demo.4demo.biz/admin/content-block#\" class=\"btn btn--primary btn--custom\">معرفة المزيد حول التسعير</a>'),
(28, 1, 'Admin Product Categories', '<div>&nbsp;</div> \r\n<div> \r\n	<h1>Categories Content File</h1><br />\r\n	 </div> \r\n<h3>Category Identifier</h3> \r\n<div>User defined free text field for unique identifier of the category. This works as a unique key for the system to identify a particular category.</div> \r\n<div><br />\r\n	 </div> \r\n<h3>Parent Identifier</h3> \r\n<div>Parent Identifier is used for categories that belong to a root/master category, essentially they are subcategories to root categories. For a category that is root/master category the parent identifier needs to be left blank.</div> \r\n<div><br />\r\n	 </div> \r\n<div>  </div> \r\n<h3>Name</h3> \r\n<div>User defined name for the category.</div> \r\n<div><br />\r\n	 </div> \r\n<div>&nbsp;</div> \r\n<h3>Description</h3> \r\n<div>User defined description for the category.</div> \r\n<div><br />\r\n	 </div> \r\n<div>&nbsp;</div> \r\n<h3>SEO Friendly URL</h3> \r\n<div>User defined URL for the category for SEO purposes. Spaces cannot be used in the URL.</div> \r\n<div><br />\r\n	 </div> \r\n<div> </div> \r\n<h3>Featured</h3> \r\n<div>User defined field to mark a particular category as featured or not. Possible inputs for this field are ‘Yes’ &amp; ‘No’.</div> \r\n<div>&nbsp;</div> \r\n<div> </div> \r\n<h3>Active</h3> \r\n<div>User defined field to mark a particular category as active in the system or not. Possible inputs for this field are ‘Yes’ &amp; ‘No’. Default value should be set as ’Yes’.</div> \r\n<div>&nbsp;</div> \r\n<div> </div> \r\n<h3>Display Order</h3>User defined field to set priority on display order of root categories or sub-categories within a root category. If more than one category has display order set to the same value then the system will display category that was added first. If you are unsure about this field add display order as ‘1’ to all the categories.     \r\n<h3>&nbsp;</h3> \r\n<h3>Deleted</h3>User defined field to mark a particular category as deleted in the system or not. Possible inputs for this field are ‘Yes’ &amp; ‘No’. Default value should be set as ’No’ to display categories in the system.  \r\n<h1>&nbsp;</h1> \r\n<h1>Categories Media File</h1> \r\n<h3>&nbsp;</h3> \r\n<h3>Category Identifier</h3>User defined unique identifier for the category. This field needs to be the same as Category Identifier defined in Categories Content sheet.    \r\n<h3>&nbsp;</h3> \r\n<h3>Lang Code</h3>User defined field to link the category image for a particular language. ‘Universal’ is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the Category has different images for each language.  \r\n<h3>&nbsp;</h3> \r\n<h3>Image Type</h3>User defined field with input options of ‘Category Icon’ &amp; ‘Category Banner’. Category icon option is to be used when uploading icon image for the category. Category banner option is to be used when uploading banner image for the category page.    \r\n<h3>&nbsp;</h3> \r\n<h3>File Path</h3>File path needs to be a publically accessible URL for example URL’s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded. Preferred image dimensions for Category Icon are 60*60 pixels. Preferred image dimensions for Category banner are 1050*340 pixels.  \r\n<h3>&nbsp;</h3> \r\n<h3>File Name</h3>Name of the image file  \r\n<h3>&nbsp;</h3> \r\n<h3>Display order</h3>When a category has multiple images then this field defines the order of display. If you are unsure about this field add display order as ‘1’ to all the categories.'),
(29, 1, 'General Settings', '<h3>Multilingual</h3>Since Yo!Rent inherently is a multilingual platform all export-import functionality where ever available in the system will only work for the particular language exported or imported in. This means that a file that is exported in English will only update English values when imported back into the system. Same items in other languages will not be updated until the user exports the same CSV in other languages makes changes and imports it back to the system.<br />\r\n  \r\n<h3>Import/Export process</h3>As a practice it is always recommended to export the CSV first make changes to it and then import it back into the system. This practice will insure accuracy of the CSV file and minimize any errors during import.<br />\r\n  \r\n<h3>Images/Media Files</h3>Any type of images/media can only be imported into the system if the file is located at a public URL. For example the file should be hosted either on a server which is accessible publically or on online tools such as Dropbox/Google Drive etc. Please note that images saved on devices and desktops cannot be imported through the CSV.<br />\r\n Once the media CSV is imported in to the system, a cron job is executed by the system to import and save the images on the server. This cron job is an automated script that the system runs after a set interval on its own and no intervention is required from the users end. The media/images imported into the system will not display immediately.<br />\r\n  \r\n<h3>Deleting Items</h3>Within Yo!Rent when an item is deleted, the system does not actually delete the item from the database rather it just hides the item from display. With the import functionality a user can restore a previously deleted item by changing the value of the deleted column from ‘Yes’ to ‘No’.<br />\r\n   \r\n<h3>Import Log File</h3>Yo!Rent will generate a CSV log file for every import action where it will log the column and row for the errors encountered during the import. If the import was successful then no log file will be generated. System will only allow importing the CSV if no errors are encountered.<br />\r\n  \r\n<h3>CSV</h3>To avoid errors it is absolutely recommended to not alter columns or its names/headers in the CSV. Also to import bulk entries it is absolutely recommended to keep maximum entries to a count of 20,000 per sheet. It is absolutely recommended to make multiple sheets for data above 20,000.<br />\r\n  \r\n<h3>Import Export Yo!Rent Settings</h3>Only turn on/off settings from the settings console if you are familiar with boolean concepts and understand how \'id\'s\' will work in a CSV. Also turning on settings from the import export settings tab may alter or add columns to the CSV. These columns are not defined in the instructions tab.&nbsp;<br />'),
(30, 1, 'Admin Brands', '<h2>&nbsp;</h2> \r\n<h2>Brands Content File</h2> \r\n<h3>&nbsp;</h3> \r\n<h3>Brand Identifier</h3>User defined unique identifier for the Brand. This works as a unique key for the system to identify a particular Brand. \r\n<h3>&nbsp;</h3> \r\n<h3>Name</h3>User defined name for the Brand in the system.  \r\n<h3>&nbsp;</h3> \r\n<h3>Description</h3>User defined description for the Brand. \r\n<h3>&nbsp;</h3> \r\n<h3>SEO Friendly URL</h3> User defined URL for the Brand for SEO purposes. Spaces cannot be used in the URL.  \r\n<h3>&nbsp;</h3> \r\n<h3>Featured</h3>User defined field to mark a particular Brand as featured or not. Possible inputs for this field are \'Yes\' &amp; \'No\'.  \r\n<h3>&nbsp;</h3> \r\n<h3>Active</h3>User defined field to mark a particular category as active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\'.  \r\n<h2>&nbsp;</h2> \r\n<h2>Brands Media File</h2> \r\n<h3>&nbsp;</h3> \r\n<h3>Brand Identifier</h3>User defined unique identifier for the Brand. This field needs to be the same as Brand Identifier defined in Brands Content sheet.    \r\n<h3>&nbsp;</h3> \r\n<h3>Lang Code</h3>User defined field to link the brand image for a particular language. \'Universal\' is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the Brand has different images for each language.  \r\n<h3>&nbsp;</h3> \r\n<h3>File Path</h3>File path needs to be a publicly accessible URL for example URL\'s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded. Preferred image dimensions are 192*82 pixels. \r\n<h3>&nbsp;</h3> \r\n<h3>File Name</h3>Name of the image file  \r\n<h3>&nbsp;</h3> \r\n<h3>Display order</h3>When a brand has multiple images then this field defines the order of display. If you are unsure about this field add display order as \'1\' to all the brands.'),
(31, 1, 'Admin Options', '<h2><br />\r\n	 <br />\r\n	 	Options Content File</h2> \r\n<h3>&nbsp;</h3> \r\n<h3>Option Identifier</h3>User defined unique identifier for the Option. This works as a unique key for the system to identify a particular Option. \r\n<h3>&nbsp;</h3> \r\n<h3>Option Name</h3>User defined name for the Option. \r\n<h3>&nbsp;</h3> \r\n<h3>Username</h3>For admin this field needs to be left blank. In case an option is added by a seller then seller username will be displayed in this field.   \r\n<h3>&nbsp;</h3> \r\n<h3>Is separate image</h3>User defined input field to denote if the option would have a separate image. Useful for color options of the product. Possible inputs for this field are \'Yes\' &amp; \'No\'.     \r\n<h3>&nbsp;</h3> \r\n<h3>Is color type</h3>User defined input field to denote if option is a color. Possible inputs for this field are \'Yes\' &amp; \'No\'. \r\n<h3>&nbsp;</h3> \r\n<h3>Display in filters</h3>User defined input field to denote if option is to be displayed in the filters on the product listing page. Possible inputs for this field are \'Yes\' &amp; \'No\'. \r\n<h3>&nbsp;</h3> \r\n<h3>Deleted</h3>User defined field to mark a particular option as deleted in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'No\' to display categories in the system. \r\n<h2>&nbsp;</h2> \r\n<h2>Options Values File</h2> \r\n<h3>&nbsp;</h3> \r\n<h3>Option value identifier</h3>User defined unique identifier for the Option value. This works as a unique key for the system to identify a particular Option value. \r\n<h3>&nbsp;</h3> \r\n<h3>Option Identifier</h3>User defined unique identifier for the option. This field value needs to be the same as the Option Identifier defined in Options Content sheet.    \r\n<h3>&nbsp;</h3> \r\n<h3>Option Value</h3>User defined value for the Option.  \r\n<h3>&nbsp;</h3> \r\n<h3>Color code</h3>User defined Hexadecimal value for the color of the option. Only to be used if the option is a color. Leave this field blank if the option is not a color. Hexadecimal for a color can be searched on Google.   \r\n<h3>&nbsp;</h3> \r\n<h3>Display order</h3>When an option has multiple option values then this field defines the order of display of the option value. If you are unsure about this field add display order as \'1\'.'),
(32, 1, 'Admin Tags', '<h2><br />\r\n	 <br />\r\n	 	Tags Content File</h2> \r\n<h3><br />\r\n	 <br />\r\n	 	Tag Identifier</h3>User defined unique identifier for the Tag. This works as a unique key for the system to identify a particular Tag. \r\n<h3><br />\r\n	 <br />\r\n	 	Username</h3>For admin this field needs to be left blank. In case a tag is added by a seller then seller username will be displayed in this field.   \r\n<h3><br />\r\n	 <br />\r\n	 	Tag name</h3>User defined name for the Tag.'),
(33, 1, 'Admin Countries Management', '<br />\r\n  \r\n<h2>Countries Content File&nbsp;</h2>  \r\n<h3><br />\r\n	 <br />\r\n	 	Country Code</h3>User defined field for unique country code.  \r\n<h3><br />\r\n	 <br />\r\n	 	Country Name</h3>User defined field for unique country name.  \r\n<h3><br />\r\n	 <br />\r\n	 	Currency Code</h3>User defined field for unique currency code for the country.  \r\n<h3><br />\r\n	 <br />\r\n	 	Language Code</h3>Language code for the country can be input here. \'Universal\' is to be used as an option if there is no preference, else relevant language code needs to be associated with the country. For example we will use \'ENG\' for the United States.&nbsp;&nbsp; \r\n<h3><br />\r\n	 <br />\r\n	 	Active</h3>User defined field to mark a particular country as active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\'.'),
(34, 1, 'Admin State Management', '<br />\r\n  \r\n<h2>States Content File</h2>  \r\n<h3><br />\r\n	 <br />\r\n	 	State Identifier</h3>User defined unique identifier for the State. This works as a unique key for the system to identify a particular State. \r\n<h3><br />\r\n	 <br />\r\n	 	Country Code</h3>This field needs to be the same as country code defined in Countries Content sheet.    \r\n<h3><br />\r\n	 <br />\r\n	 	Sate Name</h3>User defined field for unique state name. \r\n<h3><br />\r\n	 <br />\r\n	 	State Code</h3>User defined field for unique state code. \r\n<h3><br />\r\n	 <br />\r\n	 	Active</h3>User defined field to mark a particular state as active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\'.'),
(35, 1, 'Admin Manage Catalog', '<div class=\"grouplisting\">                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Product Catalog Content </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<h5>Product Identifier</h5>                                     \r\n			<p>User defined unique identifier for the Product. This works as a unique key for the system to identify a particular Product.</p>                                     \r\n			<h5>Username</h5>                                     \r\n			<p>For admin this field needs to be left blank. In case an option is added by a seller then seller username will be displayed in this field.  </p>                                     \r\n			<h5>Name</h5>                                     \r\n			<p>User defined field for product name.</p>                                     \r\n			<h5>Description</h5>                                     \r\n			<p>User defined field for product description. </p>                                     \r\n			<h5>Youtube video</h5>                                     \r\n			<p>User defined field for product Youtube video URL</p>                                     \r\n			<h5>Category Identifier</h5>                                     \r\n			<p> User defined unique identifier for the category. This field needs to be the same as Category Identifier defined in Categories Content sheet.  </p>                                     \r\n			<h5>Brand Identifier</h5>                                     \r\n			<p>User defined unique identifier for the Brand. This field needs to be the same as Brand Identifier defined in Brand Content sheet.  </p>                                     \r\n			<h5>Product Type Identifier</h5>                                     \r\n			<p>User defined input field to denote the type of the Product. Possible inputs for this field are \'Physical\' &amp; \'Digital\'. </p>                                     \r\n			<h5>Model</h5>                                     \r\n			<p>User defined field for product model.</p>                                     \r\n			<h5>Minimum selling price</h5>                                     \r\n			<p>User defined field for minimum selling price for the product.</p>                                     \r\n			<h5>Tax Category Identifier</h5>                                     \r\n			<p>User defined unique identifier for the Tax category. This field needs to be the same as Tax Category Identifier defined in the Admin console under the Sales Tax option page.</p>                                     \r\n			<h5>Length</h5>                                     \r\n			<p>User defined field for product package length.</p>                                     \r\n			<h5>Width</h5>                                     \r\n			<p>User defined field for product package width.</p>                                                                          \r\n			<h5>Height</h5>                                     \r\n			<p>User defined field for product package Height.</p>                                                                          \r\n			<h5>Dimension Unit Identifier</h5>                                     \r\n			<p>User defined input field to denote the unit of the dimensions of the package. Possible inputs for this field are \'Inch\', \'Centimeter\' &amp; \'Feet\'. </p>                                                                          \r\n			<h5>Weight </h5>                                     \r\n			<p>User defined field for product package Weight.</p>                                     \r\n			<h5>Weight Unit Identifier</h5>                                     \r\n			<p>User defined input field to denote the unit of the weight of the package. . Possible inputs for this field are \'Gram\', \'Kilogram\' &amp; \'Pound\'.</p>                                     \r\n			<h5>Ean/upc Code</h5>                                     \r\n			<p>User defined field for EAN/UPC code of the product.</p>                                     \r\n			<h5>Shipping country Code</h5>                                     \r\n			<p>This field needs to be the same as country code defined in Countries Content sheet.  </p>                                     \r\n			<h5>Added On</h5>                                     \r\n			<p>User defined field for product add date to the system.</p>                                     \r\n			<h5>Free Shipping</h5>                                     \r\n			<p>User defined field to mark a particular Product is available for free shipping. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                     \r\n			<h5>COD Available</h5>                                     \r\n			<p>User defined field to mark a particular Product is available for Cash on Delivery or not. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                     \r\n			<h5>Featured</h5>                                     \r\n			<p>User defined field to mark a particular Product as featured or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                     \r\n			<h5>Approved</h5>                                     \r\n			<p>User defined field to mark a particular Product as Approved or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\' to display products in the system.</p>                                     \r\n			<h5>Active</h5>                                     \r\n			<p>User defined field to mark a particular Product as active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\'. </p>                                     \r\n			<h5>Deleted</h5>                                     \r\n			<p>User defined field to mark a particular product as deleted in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'No\' to display products in the system. </p>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Product Option Content </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                              \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet. </p>                                    </li>                                                                              \r\n				<li>                                                                                      \r\n					<h5>Option Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Option. This field needs to be the same as Option Identifier defined in Option Content sheet. </p>                                        </li>                                                                      \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Product Tag Content</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                              \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet.</p>                                    </li>                                                                              \r\n				<li>                                                                                      \r\n					<h5>Tag Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Tag. This field needs to be the same as Tag Identifier defined in Tag Content sheet. </p>                                    </li>                                                                      \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Product Specification Content </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                              \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet.    </p>                                    </li>                                                                              \r\n				<li>                                                                                      \r\n					<h5>Lang Code</h5>                                                                                      \r\n					<p>User defined field to link the product specification for a particular language. Language codes can be looked up by clicking the language option in the top header. </p>                                    </li>                                                                              \r\n				<li>                                                                                      \r\n					<h5>Specification Name</h5>                                                                                      \r\n					<p>User defined field for product specification name.</p>                                    </li>                                                                              \r\n				<li>                                                                                      \r\n					<h5>Specification Value</h5>                                                                                      \r\n					<p>User defined field for product specification Value.</p>                                    </li>                                                                      \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Product Shipping Content </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Product Identifier</h5>                                                                                  \r\n					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet.</p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Username</h5>                                                                                  \r\n					<p>For admin this field needs to be left blank. In case an option is added by a seller then seller username will be displayed in this field. </p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Shipping Country Code</h5>                                                                                  \r\n					<p>This field needs to be the same as country code defined in Countries Content sheet. This field can be left blank if the product has no restrictions on the countries it is shipped to.</p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Shipping Company Identifier</h5>                                                                                  \r\n					<p>User defined unique identifier for the Shipping company identifier. This field needs to be the same as the Shipping Company Identifier defined in the Admin console>Shipping API>Shipping Companies page.  </p>                                        </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Shipping Duration Identifier</h5>                                                                                  \r\n					<p>User defined unique identifier for the Shipping Duration identifier. This field needs to be the same as the Shipping Duration Identifier defined in the Admin console>Shipping API>Duration Labels page. </p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Cost</h5>                                                                                  \r\n					<p>User defined field for product shipping cost.</p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Additional Item Cost</h5>                                                                                  \r\n					<p>User defined field for additional shipping cost per product.</p>                                    </li>                                                                  \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Product Catalog Media  </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Product Identifier</h5>                                                                                  \r\n					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet. </p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Lang Code</h5>                                                                                  \r\n					<p>User defined field to link the product image for a particular language. \'Universal\' is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the Product has different images for each language.</p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Option Identifier</h5>                                                                                  \r\n					<p>User defined unique identifier for the option. This field value needs to be the same as the Option Identifier defined in Options Content sheet.   </p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Option value Identifier</h5>                                                                                  \r\n					<p>User defined unique identifier for the option value. This field value needs to be the same as the Option value Identifier defined in Options Value Content sheet. </p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>File Path</h5>                                                                                  \r\n					<p>File path needs to be a publically accessible URL for example URL\'s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded. Preferred image dimensions for the product images are greater than 500*500 pixels. </p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>File Name</h5>                                                                                  \r\n					<p>Name of the image file. </p>                                    </li>                                                                          \r\n				<li>                                                                                  \r\n					<h5>Display order</h5>                                                                                  \r\n					<p>When a product has multiple images then this field defines the order of display. If you are unsure about this field add display order as \'1\'. </p>                                    </li>                                                                  \r\n			</ul>                                </div>                            </div>                        </div>');
INSERT INTO `tbl_extra_pages_lang` (`epagelang_epage_id`, `epagelang_lang_id`, `epage_label`, `epage_content`) VALUES
(36, 1, 'Seller Manage Catalog', '<div class=\"grouplisting\">                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Catalog – Product Catalog </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Product Identifier </h5>                                                                                      \r\n					<p>User defined unique identifier for the Product. This works as a unique key for the system to identify a particular Product.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Username </h5>                                                                                      \r\n					<p>For admin this field needs to be left blank. In case a product is added by a seller then seller username will be displayed in this field.  </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Name </h5>                                                                                      \r\n					<p>User defined field for product name.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Description </h5>                                                                                      \r\n					<p>User defined field for product description. er</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Youtube video</h5>                                                                                      \r\n					<p>User defined field for product Youtube video URL. </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Category Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the category. This field needs to be the same as the Category Identifier defined in Categories export sheet.   </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Brand Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Brand. This field needs to be the same as Brand Identifier defined in Brand  sheet.   </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Product Type Identifier</h5>                                                                                      \r\n					<p>User defined input field to denote the type of the Product. Possible inputs for this field are \'Physical\' &amp; \'Digital\'. </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Model </h5>                                                                                      \r\n					<p>User defined field for product model.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Minimum selling price</h5>                                                                                      \r\n					<p>User defined field for minimum selling price for the product.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Tax Category Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Tax category. This field needs to be the same as Tax Category Identifier defined in tax category export sheet.   </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Length</h5>                                                                                      \r\n					<p>User defined field for product package length.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Width</h5>                                                                                      \r\n					<p>User defined field for product package width.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Height</h5>                                                                                      \r\n					<p>User defined field for product package Height.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Dimension Unit Identifier </h5>                                                                                      \r\n					<p> User defined input field to denote the unit of the dimensions of the package. Possible inputs for this field are \'Inch\', \'Centimeter\' &amp; \'Feet\'.    </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Weight </h5>                                                                                      \r\n					<p>User defined field for product package Weight.</p>                                        </li>                                                                                     \r\n				<li>                                                                                      \r\n					<h5>Weight Unit Identifier</h5>                                                                                      \r\n					<p>User defined input field to denote the unit of the weight of the package. . Possible inputs for this field are \'Gram\', \'Kilogram\' &amp; \'Pound\'. </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Ean/upc Code</h5>                                                                                      \r\n					<p>User defined field for EAN/UPC code of the product.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Shipping country Code</h5>                                                                                      \r\n					<p>This field needs to be the same as country code defined in Countries export sheet.   </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Free Shipping </h5>                                                                                      \r\n					<p>User defined field to mark a particular Product is available for free shipping. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>COD Available</h5>                                                                                      \r\n					<p>User defined field to mark a particular Product is available for Cash on Delivery or not. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Featured</h5>                                                                                      \r\n					<p>User defined field to mark a particular Product as featured or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Approved </h5>                                                                                      \r\n					<p>User defined field to mark a particular Product as Approved or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\' to display products in the system.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Active </h5>                                                                                      \r\n					<p>User defined field to mark a particular Product as active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\'. </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Deleted </h5>                                                                                      \r\n					<p>User defined field to mark a particular product as deleted in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'No\' to display products in the system. </p>                                        </li>                                        \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Catalog - Product Option </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p> User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.    </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Option Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Option. This field needs to be the same as Option Identifier defined in Option export sheet.</p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Catalog - Product Tags</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.    </p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Tag Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Tag. This field needs to be the same as tag Identifier defined in tags export sheet.</p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Catalog - Product Specifications</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.    </p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Lang Code</h5>                                                                                      \r\n					<p>User defined field to link the product specification for a particular language. Language codes can be looked up by clicking the language option in the top header. </p>                                        </li>                                             \r\n				<li>                                                                                      \r\n					<h5>Specification Name</h5>                                                                                      \r\n					<p>User defined field for product specification name.</p>                                        </li>                                             \r\n				<li>                                                                                      \r\n					<h5>Specification Value</h5>                                                                                      \r\n					<p>User defined field for product specification Value.</p>                                        </li>                                         \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Catalog - Product Shipping</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p> User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.    </p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Username</h5>                                                                                      \r\n					<p>For admin this field needs to be left blank. In case an option is added by a seller then seller username will be displayed in this field.  </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Shipping Country Code</h5>                                                                                      \r\n					<p>This field needs to be the same as country code defined in the Countries export sheet. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Shipping Company Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Shipping company identifier. This field needs to be the same as the Shipping Company Identifier defined in the Admin console>Shipping API>Shipping Companies page. Please contact the admin for details.     </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Shipping Duration Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Shipping Duration identifier. This field needs to be the same as the Shipping Duration Identifier defined in the Admin console>Shipping API>Duration Labels page. Please contact the admin for details.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Cost</h5>                                                                                      \r\n					<p>User defined field for product shipping cost.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Additional Item Cost </h5>                                                                                      \r\n					<p>User defined field for additional shipping cost per product.</p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Catalog - Product Media</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.</p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Lang Code</h5>                                                                                      \r\n					<p>User defined field to link the image for a particular language. \'Universal\' is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the product has different images for each language.</p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Option Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Option. This field needs to be the same as Option Identifier defined in Option export sheet.    </p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Option Value Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Option value. This field needs to be the same as the Option value Identifier defined in the Option value export sheet.    </p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>File Path</h5>                                                                                      \r\n					<p>File path needs to be a publically accessible URL for example URL\'s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded.</p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>File Name</h5>                                                                                      \r\n					<p>Name of the image file</p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Display order</h5>                                                                                      \r\n					<p>When a product has multiple images then this field defines the order of display. If you are unsure about this field add display order as \'1\'. </p>                                        </li>                                       \r\n			</ul>                                </div>                            </div>                        </div>'),
(37, 1, 'Seller Import Export General Settings', '<h5>Multilingual</h5>\r\n<p>Since Yo!Rent inherently is a multilingual platform all export-import functionality where ever available in the system will only work for the particular language exported or imported in. This means that a file that is exported in English will only update English values when imported back into the system. Same items in other languages will not be updated until the user exports the same CSV in other languages makes changes and imports it back to the system.</p>\r\n<h5>Import/Export process</h5>\r\n<p>As a practice it is always recommended to export the CSV first make changes to it and then import it back into the system. This practice will insure accuracy of the CSV file and minimize any errors during import.</p>\r\n<h5>Images/Media Files</h5>\r\n<p>Any type of images/media can only be imported into the system if the file is located at a public URL. For example the file should be hosted either on a server which is accessible publically or on online tools such as Dropbox/Google Drive etc. Please note that images saved on devices and desktops cannot be imported through the CSV.<br />\r\n	Once the media CSV is imported in to the system, a cron job is executed by the system to import and save the images on the server. This cron job is an automated script that the system runs after a set interval on its own and no intervention is required from the users end. The media/images imported into the system will not display immediately.</p>\r\n<h5>Deleting Items</h5>\r\n<p>Within Yo!Rent when an item is deleted, the system does not actually delete the item from the database rather it just hides the item from display. With the import functionality a user can restore a previously deleted item by changing the value of the deleted column from Yes to No.</p>\r\n<h5>Import Log File</h5>\r\n<p>Yo!Rent will generate a CSV log file for every import action where it will log the column and row for the errors encountered during the import. If the import was successful then no log file will be generated. System will only allow importing the CSV if no errors are encountered.</p>\r\n<h5>CSV</h5>\r\n<p>To avoid errors it is absolutely recommended to not alter columns or its names/headers in the CSV. Also to import bulk entries it is absolutely recommended to keep maximum entries to a count of 20,000 per sheet. It is absolutely recommended to make multiple sheets for data above 20,000.</p>\r\n<h5>Import Export Yo!Rent Settings</h5>\r\n<p>Only turn on/off settings from the settings console if you are familiar with boolean concepts and understand how id\'s will work in a CSV. Also turning on settings from the import export settings tab may alter or add columns to the CSV. These columns are not defined in the instructions tab.</p>');
INSERT INTO `tbl_extra_pages_lang` (`epagelang_epage_id`, `epagelang_lang_id`, `epage_label`, `epage_content`) VALUES
(38, 1, 'Products Inventory - Admin', '<div class=\"grouplisting\">                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – General Data  </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined unique id for the Product. This field needs to be unique.</p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p>User defined identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog Content sheet. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Username</h5>                                                                                      \r\n					<p>Username of the seller to which inventory is being updated.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Selling price</h5>                                                                                      \r\n					<p>Selling price of the product </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Stock</h5>                                                                                      \r\n					<p>Quantity available for the product </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Min Order Quantity</h5>                                                                                      \r\n					<p>Minimum quantity that a buyer can purchase for the product</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Subtract Stock</h5>                                                                                      \r\n					<p>User defined field to mark if the system should subtract stock or not once an order is placed. Possible inputs for this field are \'Yes\' &amp; \'No\'.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Track Inventory</h5>                                                                                      \r\n					<p>User defined field to mark if the system should monitor inventory or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Threshold Stock Level</h5>                                                                                      \r\n					<p>User defined field to input threshold stock level upon which the system would generate an alert email. This will only work if both Subtract Stock &amp; Track Inventory are set as \'Yes\'.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Condition identifier</h5>                                                                                      \r\n					<p> User defined field to define a particular product\'s condition in the system. Possible inputs for this field are \'New\', \'Used\' &amp; \'Refurbished\'.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Digital Product Max Download time</h5>                                                                                      \r\n					<p>User defined field to define maximum number of times a digital product can be downloaded. Possible inputs for this field are integers.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Download validity in days</h5>                                                                                      \r\n					<p>User defined field to define maximum number of days until the digital product can be downloaded. Possible inputs for this field are integers.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Title</h5>                                                                                      \r\n					<p>User defined field to define the title of the product in the shop. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Comments</h5>                                                                                      \r\n					<p> User defined field to input comments for the product.</p>                                        </li>                                                                                  \r\n				<li>                                                                                      \r\n					<h5>URL Keyword</h5>                                                                                      \r\n					<p>User defined field for input of URL keywords, used for URL rewriting.&nbsp;&nbsp;</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Added on </h5>                                                                                      \r\n					<p>User defined date field to input the date the product is added into the system. Date format is mm/dd/yy</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Available from </h5>                                                                                      \r\n					<p> User defined date field to input the date the product is available from. Date format is mm/dd/yy</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Active</h5>                                                                                      \r\n					<p>User defined field to mark a particular product as Active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\' to display products in the system.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>COD Available</h5>                                                                                      \r\n					<p>User defined field to mark a particular product is available for cash on delivery in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Deleted</h5>                                                                                      \r\n					<p>User defined field to mark a particular product as deleted in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'No\' to display products in the system.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Sold count</h5>                                                                                      \r\n					<p>System defined field to show the user cold count for a particular product. This field cannot be updated by the user.</p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Product Options  </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id </h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Option Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Option. This field needs to be the same as the option identifier defined in the Options content sheet.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Option Value Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Option value. This field needs to be the same as the option value identifier defined in the Options value content sheet.</p>                                        </li>                                        \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – SEO Data </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.  </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Meta Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Meta data. This works as a unique key for the system to identify a particular Meta data.</p>                                        </li>                                             \r\n				<li>                                                                                      \r\n					<h5>Meta Title</h5>                                                                                      \r\n					<p>User defined input field for the user to define Meta title for the product.</p>                                        </li>                                             \r\n				<li>                                                                                      \r\n					<h5>Meta Keywords</h5>                                                                                      \r\n					<p>User defined input field for the user to define Meta keywords for the product.</p>                                        </li>                                             \r\n				<li>                                                                                      \r\n					<h5>Meta Description</h5>                                                                                      \r\n					<p>User defined input field for the user to define Meta Description for the product.</p>                                        </li>                                             \r\n				<li>                                                                                      \r\n					<h5>Other Meta Tags </h5>                                                                                      \r\n					<p>User defined input field for the user to define other Meta tags for the product.</p>                                        </li>                                         \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Special Price</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id </h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.  </p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Start Date</h5>                                                                                      \r\n					<p>User defined date field to input the date from which the special price of the product starts from. Date format is mm/dd/yy</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>End Date</h5>                                                                                      \r\n					<p>User defined date field to input the date from which the special price of the product ends on. Date format is mm/dd/yy</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Price</h5>                                                                                      \r\n					<p>User defined field for special price of the product. </p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Volume Discount </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Min Quantity</h5>                                                                                      \r\n					<p>User defined field for minimum quantity of the product to be purchased for volume discount.</p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Discount Percentage</h5>                                                                                      \r\n					<p>User defined field for discount percentage to be applied to the product in case of the volume discount. </p>                                        </li>                                       \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Buy Together </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Buy Together Selprod Id</h5>                                                                                      \r\n					<p>User defined product identifier for the buy together related Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                       \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Related Products </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                           \r\n				<li>                                                                                      \r\n					<h5>Related Selprod Id</h5>                                                                                      \r\n					<p>User defined product identifier for the related Products. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Seller Product Policy  </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id </h5>                                                                                      \r\n					<p> User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Policy Point Identifier</h5>                                                                                      \r\n					<p>User defined policy point identifier for the Product. This field needs to be the same as the policy point identifier defined on the Policy Points Management page under the CMS tab in the admin console. </p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Media  </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                            \r\n				<li>                                                                                      \r\n					<h5>Lang Code</h5>                                                                                      \r\n					<p>User defined field to link the image for a particular language. \'Universal\' is to be used as an option to link the media in all languages. Language codes can be looked up by clicking the language option in the top header. Language codes need to be used if the product has different images for each language.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>File Path</h5>                                                                                      \r\n					<p>File path needs to be a publically accessible URL for example URL\'s from Google Drive, Dropbox etc. Images stored locally on your personal device/machine cannot be uploaded.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>File Name</h5>                                                                                      \r\n					<p>Name of the image file </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Display order</h5>                                                                                      \r\n					<p>When a product has multiple images then this field defines the order of display. If you are unsure about this field add display order as \'1\'.</p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                        </div>'),
(39, 1, 'Products Inventory - Seller', '<div class=\"grouplisting\">                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – General Data </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined unique id for the Product. This field needs to be unique.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Product Identifier</h5>                                                                                      \r\n					<p>User defined identifier for the Product. This field needs to be the same as Product Identifier defined in the Product Catalog sheet.  </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Selling price </h5>                                                                                      \r\n					<p>Selling price of the product</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Stock</h5>                                                                                      \r\n					<p>Quantity available for the product </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Min Order Quantity</h5>                                                                                      \r\n					<p>Minimum quantity that a buyer can purchase for the product</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Subtract Stock</h5>                                                                                      \r\n					<p>User defined field to mark if the system should subtract stock or not once an order is placed. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Track Inventory</h5>                                                                                      \r\n					<p> User defined field to mark if the system should monitor inventory or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Threshold Stock Level </h5>                                                                                      \r\n					<p>User defined field to input threshold stock level upon which the system would generate an alert email. This will only work if both Subtract Stock &amp; Track Inventory are set as \'Yes\'.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Condition identifier </h5>                                                                                      \r\n					<p>User defined field to define a particular product\'s condition in the system. Possible inputs for this field are \'New\', \'Used\' &amp; \'Refurbished\'.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Digital Product Max Download time</h5>                                                                                      \r\n					<p>User defined field to define maximum number of times a digital product can be downloaded. Possible inputs for this field are integers.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Download validity in days</h5>                                                                                      \r\n					<p>User defined field to define maximum number of days until the digital product can be downloaded. Possible inputs for this field are integers.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Title </h5>                                                                                      \r\n					<p>User defined field to define the title of the product in the shop. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Comments</h5>                                                                                      \r\n					<p>User defined field to input comments for the product.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>URL Keyword</h5>                                                                                      \r\n					<p>&nbsp;User defined field for input of URL keywords, used for URL rewriting.&nbsp;&nbsp;</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Available from</h5>                                                                                      \r\n					<p>User defined date field to input the date the product is available from. Date format is mm/dd/yy</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Active</h5>                                                                                      \r\n					<p>User defined field to mark a particular product as Active in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. Default value should be set as \'Yes\' to display products in the system.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>COD Available</h5>                                                                                      \r\n					<p>User defined field to mark a particular product is available for cash on delivery in the system or not. Possible inputs for this field are \'Yes\' &amp; \'No\'. </p>                                        </li>                                                                              \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Product Options</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                          \r\n				<li>                                                                                      \r\n					<h5>Option Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Option. This field needs to be the same as Option Identifier defined in Option export sheet. </p>                                        </li>                                          \r\n				<li>                                                                                      \r\n					<h5>Option Value Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Option value. This field needs to be the same as Option Value Identifier defined in Option Value export sheet.</p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – SEO</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id </h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.    </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Meta Identifier</h5>                                                                                      \r\n					<p>User defined unique identifier for the Meta data. This works as a unique key for the system to identify a particular Meta data.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Meta Title</h5>                                                                                      \r\n					<p>User defined input field for the user to define Meta title for the product. </p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Meta Keywords</h5>                                                                                      \r\n					<p>User defined input field for the user to define Meta keywords for the product.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Meta Description</h5>                                                                                      \r\n					<p>User defined input field for the user to define Meta Description for the product.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Other Meta Tags </h5>                                                                                      \r\n					<p>User defined input field for the user to define other Meta tags for the product.</p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Special Price </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Start Date</h5>                                                                                      \r\n					<p>User defined date field to input the date from which the special price of the product starts from. Date format is mm/dd/yy</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>End Date</h5>                                                                                      \r\n					<p>User defined date field to input the date from which the special price of the product ends on. Date format is mm/dd/yy</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Price</h5>                                                                                      \r\n					<p>User defined field for special price of the product. </p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Volume Discount </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Min Quantity </h5>                                                                                      \r\n					<p>User defined field for minimum quantity of the product to be purchased for volume discount.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Discount Percentage </h5>                                                                                      \r\n					<p>User defined field for discount percentage to be applied to the product in case of the volume discount. </p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Buy Together </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id </h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Buy Together Selprod Id</h5>                                                                                      \r\n					<p>User defined product identifier for the buy together related Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5>  Seller Products – Related Products</h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Related Selprod Id</h5>                                                                                      \r\n					<p>User defined product identifier for the related Products. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.  </p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                             \r\n	<div class=\"groups group-js\">                                 \r\n		<div class=\"group__head group__head-js\"> \r\n			<h5> Seller Products – Seller Product Policy </h5></div>                                 \r\n		<div class=\"group__body group__body-js\">                                     \r\n			<ul>                                                                      \r\n				<li>                                                                                      \r\n					<h5>Seller Product Id</h5>                                                                                      \r\n					<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>                                        </li>                                         \r\n				<li>                                                                                      \r\n					<h5>Policy Point Identifier </h5>                                                                                      \r\n					<p> User defined policy point identifier for the Product. This field needs to be the same as the policy point identifier defined on the Policy Points Management page under the CMS tab in the admin console. </p>                                        </li>                                     \r\n			</ul>                                </div>                            </div>                        </div>'),
(40, 1, 'Product Inventory Update Instructions', '<h5>Seller Product Id</h5>\r\n<p>User defined product identifier for the Product. This field needs to be the same as the seller product identifier defined in the Seller Product General Data sheet.</p>\r\n<h5>SKU</h5>\r\n<p>User defined field for the product SKU.</p>\r\n<h5>Product</h5>\r\n<p>User defined field for the product name.</p>\r\n<h5>Price</h5>\r\n<p>User defined field for the product price.</p>\r\n<h5>Stock/quantity</h5>\r\n<p>User defined field for the stock/quantity of the product.</p>');
