(573, 'LBL_SIGN_UP_HELP_DESCRIPTION', 1, 'If this is your first time shopping with us, please enter an email address to use as your Newegg ID and create a password for your account. Your Newegg account \nallows you to conveniently place orders, create wishlists, check the status of your recent orders and much more.', 1),
(575, 'LBL_SIGN_UP_HELP_DESCRIPTION', 2, 'إذا كانت هذه هي المرة الأولى التي تسوق معنا، يرجى إدخال عنوان البريد الإلكتروني لاستخدام ID رومنسيه وإنشاء كلمة مرور لحسابك. الحساب الخاص بك رومنسيه\nيسمح لك بوضع مريح أوامر، وخلق الأماني، تحقق من حالة طلباتك الأخيرة، وأكثر من ذلك بكثير.', 1),
(576, 'LBL_LOGIN_HELP_POINTS', 1, '1. Enable Cookies. \n2. Enable Javascript. \n3. Refresh the page.', 1),
(578, 'LBL_LOGIN_HELP_POINTS', 2, '1. تمكين ملفات تعريف الارتباط.\n2. تمكين جافا سكريبت.\n3. قم بتحديث الصفحة.', 1),
(581, 'LBL_LOGIN_HELP_DESCRIPTION', 1, 'If You Are Having Problems Logging In, Try The Following:', 1),
(585, 'LBL_LOGIN_HELP_DESCRIPTION', 2, 'إذا كنت تواجه مشاكل في تسجيل الدخول، حاول القيام بما يلي:', 1),
(586, 'LBL_CHECKOUT_SIGN_UP_HELP_POINTS_HEADING', 1, 'In an effort to keep your sensitive information secure, we have some minimum password requirements.', 1),
(588, 'LBL_CHECKOUT_SIGN_UP_HELP_POINTS_HEADING', 2, 'في محاولة للحفاظ على المعلومات الحساسة الخاصة بك آمنة، لدينا بعض متطلبات كلمة المرور الحد الأدنى.', 1),
(590, 'LBL_CHECKOUT_SIGN_UP_HELP_POINTS', 1, '1. Eight (8) to thirty (30) characters long.\n2.Meet three of these four rules:\n- Use uppercase letters\n- Use lowercase letters\n- Use at least one number\n- Use special characters (!, @, #, $, %, ^, &, *, ?...)', 1),
(592, 'LBL_CHECKOUT_SIGN_UP_HELP_POINTS', 2, '1. ثمانية (8) إلى (30) حرفا.\n2.Meet ثلاثة من هذه القواعد الأربع:\n- استخدام الأحرف الكبيرة\n- استخدام أحرف صغيرة\n- استخدام رقم واحد على الأقل\n- (!؟، @، #، $،٪، ^، &، *، ...) استخدام أحرف خاصة', 1),
